(90, NULL, NULL, '89', 'ดูน่าเชื่อถือมีอำนาจบารมีดูหยิ่งยโสเข้าถึงยาก', 'P23'),
(91, NULL, NULL, '90', 'บุคลิกดูอินเตอร์ ดูฉลาด ดูมีเอกลักษณ์ของตัวเองที่แปลกไม่เหมือนใคร เข้าถึงยาก', 'P23'),
(92, NULL, NULL, '91', 'บุคลิกโดดเด่น มีเสน่ห์ มีความเป็นตัวเองสูงเริ่ดเชิดมั่นใจ โดดเด่น มีสไตล์ไม่เหมือนใคร มีความเป็นคนทันสมัย ทันเทรนด์', 'P23'),
(93, NULL, NULL, '92', 'ดูสดใสหน้าตายิ้มแย้ม บุคลิกแต่งตัวด้วยสไตล์ของตัวเอง มีเอกลักษณ์เฉพาะตัว', 'P23'),
(94, NULL, NULL, '93', 'ดูเป็นคนปราดเปรียว คล่องตัว กระฉับกระเฉง และอาจดูเป็นคนแรงๆ ตรงๆ ', 'P23'),
(95, NULL, NULL, '94', 'แต่งตัวทำมัทำแมงคล่องตัวบุคลิกดูดีทันสมัยลุยลุย', 'P23'),
(96, NULL, NULL, '95', 'เป็นคนที่ดูนิ่งนิ่งมาดูบุคลิกดูน่าเชื่อถือมีความเป็นผู้ใหญ่สูง', 'P23'),
(97, NULL, NULL, '96', 'ดูมีเสน่ห์ดึงดูดในแบบฉบับตัวเองมีจุดเด่นหน้าเข้าหาเค้าได้กับคนทุกระดับทุกสังคมและอารมณ์ดี', 'P23'),
(98, NULL, NULL, '97', 'ดูนิ่งนิ่งไม่มีปฏิกิริยาใดใดกับโลกภายนอกเหมือนหุ่นดูไร้อารมณ์', 'P23'),
(99, NULL, NULL, '98', 'ดูน่าเชื่อถือมีอำนาจบารมีดูหยิ่งยโสเข้าถึงยาก', 'P23'),
(100, NULL, NULL, '99', 'ดูน่าเชื่อถือมีอำนาจบารมีบุคลิกดูเข้าถึงยากดูเป็นคนทันสมัย', 'P23'),
(101, NULL, NULL, '0', 'พูดเก่ง มีเรื่องเล่ามากมาย มีโอกาศพูดไม่รู้เรื่อง ทำอะไรไม่ค่อยคิดเยอะ มีภาษาและสไตล์ การพูดของตัวเอง', 'P45'),
(102, NULL, NULL, '1', 'พูดจาโผงผาง ไม่แคร์ใคร ตัดสินใจคนเดืยว ปากไม่ตรงกับใจ ใช้อารมณ์ ในการสื่อสาร ขี้หงุดหงิด', 'P45'),
(103, NULL, NULL, '2', 'มีความฉอเลาะ คุยเก่ง คุยเพ้อเจ้อ ค่อนข้างขี้โม้ ในบางครั้งอาจพูดเยอะน่ารำคาญ ไม่มีแก่นสาร จับประเด็นในสิ่งที่พูดออกมาได้ยาก', 'P45'),
(104, NULL, NULL, '3', 'ทำงานเร็ว มีโอกาศที่จะทะเลาะกับเพื่อนร่วมงาน เพราะความสะเพร่า พร้อมทั้งยังมีความปากเสีย ปากไว หรือน้ำเสียงที่ชวนทำให้คนฟังรู้สึกหงุดหงิด', 'P45'),
(105, NULL, NULL, '4', 'มีไหวพริบในการตอบโต้ พูดจาไม่เหมือนใคร ชอบสำบัดสำนวน มักชอบมีการแซะหรือจิกกัดเล็กๆเหน็บแนมบ่อยๆพร้อมทั้งมักเปลี่ยนเรื่องคุยค่อนข้างไวพูดอาจจะไม่ค่อยมีสาระ แต่สนุก', 'P45'),
(106, NULL, NULL, '5', 'ไม่ค่อยมีการตอบโต้ใดๆจากบุคคลนี้ ปฏิสัมพันธ์ทางสังคมติดลบ พูดน้อย เข้าใจยาก', 'P45'),
(107, NULL, NULL, '6', 'ยิ้มแย้มแจ่มใส ดูต้อนรับทุกคนได้ดี สามารถสรรหาเรื่องสนทนาได้เรื่อยๆ', 'P45'),
(108, NULL, NULL, '7', 'ไม่ค่อยพูด หรือถ้าพูด ก็จะพูดน้อยๆ แต่ต่อยหนัก', 'P45'),
(109, NULL, NULL, '8', 'เป็นคนทำอะไรดูมั่นใจมากๆ และไม่แคร์ใครที่ไหน ไม่ระวังในการพูด พูดไม่คิด ขี้โอ่ ขี้โม้', 'P45'),
(110, NULL, NULL, '9', 'เป็นคนพูดหรือสื่อสารอะไรที่คนปกติฟังไม่รู้เรื่อง ใช้คำพูดหรือภาษาแปลกๆ พูดเรื่องเข้าใจง่ายให้เข้าใจยากได้ แต่คุยกันคนต่างชาติเก่ง เพราะมีความกล้าที่จะสื่อสาร', 'P45'),
(111, NULL, NULL, '10', 'พูดจาโผงผาง ไม่แคร์ใคร ตัดสินใจคนเดืยว ปากไม่ตรงกับใจ ใช้อารมณ์ ในการสื่อสาร ขี้หงุดหงิด', 'P45'),
(112, NULL, NULL, '11', 'การปฏิสัมพันธ์กับสังคมดูไม่เป็นมิตร ไม่น่าคบหา อยู่ใกล้ๆแล้วรู้สึกอึดอัดโดนกดดันอยู่ตลิดเวลา อาจมีคำพูดที่ห้วน สั้น ฟังไม่เข้าหูพูดตรงแรง พูดจาเอาชนะ ชวนทะเลาะ', 'P45'),
(113, NULL, NULL, '12', 'พูดจากลับไปกลับมา ไม่มีคงามมั่นคง ใช่วาจาลดคุณค่าของคนรอบตัว ใครร่วมงานด้วยมักจะไม่ชอบ ไม่อย่างมีปฏิสัมพันธ์ ไม่เข้าใจจุดประสงค์ที่พูด', 'P45'),
(114, NULL, NULL, '13', 'อารมณ์รุงแรง ทำอะไรเด็ดขาดและรวดเร็ว คำพูดตรงไปตรงมาไม่เกรงกลัวใคร เสียงดังเสียงแข็ง ไม่อ้อมค้อม เป็นคนปากว่ามือถึง มักมีเรื่อง ขัดแย้งรอบตัว อยู่ตลอด แต่หากได้ทำงานสายช่างหรือกีฬา จะเป็นคนที่ไหวพริบดีตอบสนองไว และมีเกณฑ์ทำให้อารมณ์ร้อนลดน้อยลงกว่ากลุ่มอาชีพอื่น', 'P45'),
(115, NULL, NULL, '14', 'การเจรจาดูมีหลักการ คุยเก่ง คุยสนุก พูดเยอะแต่ไม่น่าเบื่อ แถมยังดูน่าสนใจ แก้ไขปัญหาเฉพาะหน้าเก่ง เอาตัวรอดได้ดี มีคนรู้จักมาก เพื่อนเยอะ', 'P45'),
(116, NULL, NULL, '15', 'พูดน้อยแต่มีเหตุมีผล วาจาน่าเชื่อถือน้ำเสียงนุ่มนวลน่าฟัง มีความเป็นผู้ใหญ่', 'P45'),
(117, NULL, NULL, '16', 'วาจาคำพูดดูดี และชอบพูดยกยอตัวเองเป็นหลักบางครั้งอาจรู้สึกว่ามีการประดิษฐ์คำพูดมากจนเกินไป', 'P45'),
(118, NULL, NULL, '17', 'เป็นคนพูดตรงไปตรงมา ไม่ค่อยมีวาทศิลป์สักเท่าไหร่ มีอำนาจในการควบคุมคน ขึงขังจนตึงเครียด', 'P45'),
(119, NULL, NULL, '18', 'พูดจาโผงผางไม่เกรงใจใคร พูดตรง พูดแรง กดดัน ไม่ไว้หน้าใคร ชอบโอ้อวด', 'P45'),
(120, NULL, NULL, '19', 'พูดจาคล่องแคล่ว มีประเด็นหัวข้อชัดเจน ต่อรองเก่ง มีทักษะการ สื่อสารทางธุรกิจ สื่อสารกับต่างชาติ มีความคล่องตัวว่องไว มั่นใจในตัวเอง กล้าแสดงออก', 'P45'),
(121, NULL, NULL, '20', 'มีความฉอเลาะ คุยเก่ง คุยเพ้อเจ้อ ค่อนข้างขี้โม้ ในบางครั้งอาจพูดเยอะน่ารำคาญ ไม่มีแก่นสาร จับประเด็นในสิ่งที่พูดออกมาได้ยาก', 'P45'),
(122, NULL, NULL, '21', 'พูดจากลับไปกลับมา ไม่มีคงามมั่นคง ใช่วาจาลดคุณค่าของคนรอบตัว ใครร่วมงานด้วยมักจะไม่ชอบ ไม่อย่างมีปฏิสัมพันธ์ ไม่เข้าใจจุดประสงค์ที่พูด', 'P45'),
(123, NULL, NULL, '22', 'คุยเก่งมีวาทศิลป์ พูดนิ่มๆ อะไรก็ได้ ไม่ถนัดการโต้แย้งทุกรูปแบบ', 'P45'),
(124, NULL, NULL, '23', 'พูดจาเร็ว กระชับ บางครั้งก็ห้วนๆไป แต่ก็ฟังแล้ว น่าคุยด้วยเพราะเขามีลูกเล่นในการพูด บวกกับบางครั้งก็ดูกวนๆแปลกๆ', 'P45'),
(125, NULL, NULL, '24', 'พูดคุยเก่ง พูดเป็น ช่าง เจรจา น้ำเสียงนุ่มนวล ดูเป็นมิตร แต่อาจจะไม่ใช่นักต่อรองที่ดี ขาดความดุ และน่าเกรงขาม จึงไม่โดดเด่นด้านอำนาจบารมี', 'P45'),
(126, NULL, NULL, '25', 'พูดจาสุภาพนุ่มนวล ไม่โหวกเหวกโวยวาย อ่อนน้อมถ่อมตน สร้างความรู้สึกสบายๆ แต่มีความเขินอายกับคนหมู่มาก และอาจะทำให้อำนาจที่มีลดลงได้', 'P45'),
(127, NULL, NULL, '26', 'คุยเก่ง คุยสนุก มีมุกหยอดเฮฮาอยู่ตลอดเวลา มักมีน้ำเสียงสบายๆ ตามน้ำเก่ง มีความเป็นทั้งผู้พูด และผู้ฟังอยู่ในตัว ปรับตัวเก่ง', 'P45'),
(128, NULL, NULL, '27', 'ขาดความมั่นอกมั่นใจในการพูด มักมีปัญหาเรื่องการเจรจาต่อรอง ขาดความน่าเชื่อถือ แม้ข้อมูลจะเป็นความจริง ไม่สามารถควบคุมลูกน้องหรือบริวารได้มักเป็นผู้ฟังที่ดี', 'P45'),
(129, NULL, NULL, '28', 'คำพูดดูเหวี่ยง ดูหยิ่งยโส ไม่แคร์ใคร เป็นคนทำอะไรเร็ว ทำอะไรได้โดยไม่เกรงใจใคร ชอบคุยโวโอ้อวด ในสิ่งที่ตนมีและยังไม่มี แต่หากมีเวลาเตรียมตัวก็สามารถประดิษฐ์คำพูดให้ดูดี และมีเสน่ห์ได้', 'P45'),
(130, NULL, NULL, '29', 'อัธยาศัยดี คุยเก่ง กล้าที่จะคิดและกล้าที่จะพูด แต่เป็นคนที่ไม่ค่อยกล้าลงมือทำอะไรจริงๆมากนัก ไม่สไตล์การพูดเป็นของตัวเอง และมักทำให้คนที่คุยด้วยจดจำได้', 'P45'),
(131, NULL, NULL, '30', 'ทำงานเร็ว มีโอกาศที่จะทะเลาะกับเพื่อนร่วมงาน เพราะความสะเพร่า พร้อมทั้งยังมีความปากเสีย ปากไว หรือน้ำเสียงที่ชวนทำให้คนฟังรู้สึกหงุดหงิด', 'P45'),
(132, NULL, NULL, '31', 'อารมณ์รุงแรง ทำอะไรเด็ดขาดและรวดเร็ว คำพูดตรงไปตรงมาไม่เกรงกลัวใคร เสียงดังเสียงแข็ง ไม่อ้อมค้อม เป็นคนปากว่ามือถึง มักมีเรื่อง ขัดแย้งรอบตัว อยู่ตลอด แต่หากได้ทำงานสายช่างหรือกีฬา จะเป็นคนที่ไหวพริบดีตอบสนองไว และมีเกณฑ์ทำให้อารมณ์ร้อนลดน้อยลงกว่ากลุ่มอาชีพอื่น', 'P45'),
(133, NULL, NULL, '32', 'พูดจาเร็ว กระชับ บางครั้งก็ห้วนๆไป แต่ก็ฟังแล้ว น่าคุยด้วยเพราะเขามีลูกเล่นในการพูด บวกกับบางครั้งก็ดูกวนๆแปลกๆ', 'P45'),
(134, NULL, NULL, '33', 'การพูดจะแรงๆห้วนๆ ตรงไปตรงมา ขาดน้ำเสียง ที่นุ่มนวล แต่ก็มีสัญชาตญาณในการโต้ตอบดี มักเสริม ทักษะด้านกีฬา  หรืองานที่ต้องใช้ความสามารถ ในการตัดสินใจแบบชั่วพริบตา', 'P45'),
(135, NULL, NULL, '34', 'เป็นคนพูดตรงไปตรงมา ปัญหาอยู่ที่ว่ามักจะพูดอะไรไม่เข้าหูคน พูดเร็ว แต่ชัดเจน ตรงประเด็น ไม่สร้างภาพ', 'P45'),
(136, NULL, NULL, '35', 'เป็นคนพูดจาหนักแน่น ตรงไปตรงมา มีความน่าเชื่อถือ มีความสามารถด้านการออกคำสั่ง และเก่งในการขายสินค้าที่มีมูลค่าสูง', 'P45'),
(137, NULL, NULL, '36', 'เป็นคนช่างเจรจา มีเสน่ห์  สร้างแรงขับเคลื่อนให้กับทุกคนที่อยู่รายล้อมเป็นจุดเด่นของกลุ่มเพื่อนๆ เป็นคนกล้าพูด กล้าทำเป็นคนคล่องตัว เก่งทางด้านการต่อรอง หากตัดสินใจทำอะไรมักไม่มีอะไรขัด มีความสามารถด้านการค้าขาย ปิดการขายเก่ง และทำให้คนที่อยู่รอบตัวรู้สึกสนกกนานเฮฮาได้ แต่บทที่จะจริงจังก็ทำให้คนรอบตัวเครียดได้เหมือนกันนะ', 'P45'),
(138, NULL, NULL, '37', 'การเจรจาตรงไปตรงมา พูดห้วนไม่ค่อยมีหางเสียง ขาดลูกเล่นในการใช้คำพูด บทสนทนาดูจริงจัง ขาดเสน่ห์', 'P45'),
(139, NULL, NULL, '38', 'พูดเสียงดังฟังชัด บางครั้งเหมือนตะโกน คำพูดเด็ดขาด คำไหนคำนั้น เป็นคนปากว่ามือถึง ควบคุมอารมณ์ไม่เก่ง', 'P45'),
(140, NULL, NULL, '39', 'พูดเร็ว คิดเร็ว ทำเร็ว คนอื่นตามไม่ทัน จะเป็นคนพูดตรงมากๆ ไม่เกรงใจใคร เป็นคำพูดที่ฟังง่าย ชัดเจน แต่เต็มไปด้วยพลังและอำนาจในน้ำเสียงนั้นๆ คนรอบๆตัวอาจจะมองว่าเป็นคำพูดของคนที่ชอบใช้อารมณ์', 'P45'),
(141, NULL, NULL, '40', 'มีไหวพริบในการตอบโต้ พูดจาไม่เหมือนใคร ชอบสำบัดสำนวน มักชอบมีการแซะหรือจิกกัดเล็กๆเหน็บแนมบ่อยๆพร้อมทั้งมักเปลี่ยนเรื่องคุยค่อนข้างไวพูดอาจจะไม่ค่อยมีสาระ แต่สนุก', 'P45'),
(142, NULL, NULL, '41', 'การเจรจาดูมีหลักการ คุยเก่ง คุยสนุก พูดเยอะแต่ไม่น่าเบื่อ แถมยังดูน่าสนใจ แก้ไขปัญหาเฉพาะหน้าเก่ง เอาตัวรอดได้ดี มีคนรู้จักมาก เพื่อนเยอะ', 'P45'),
(143, NULL, NULL, '42', 'พูดคุยเก่ง พูดเป็น ช่าง เจรจา น้ำเสียงนุ่มนวล ดูเป็นมิตร แต่อาจจะไม่ใช่นักต่อรองที่ดี ขาดความดุ และน่าเกรงขาม จึงไม่โดดเด่นด้านอำนาจบารมี', 'P45'),
(144, NULL, NULL, '43', 'เป็นคนพูดตรงไปตรงมา ปัญหาอยู่ที่ว่ามักจะพูดอะไรไม่เข้าหูคน พูดเร็ว แต่ชัดเจน ตรงประเด็น ไม่สร้างภาพ', 'P45'),
(145, NULL, NULL, '44', 'เป็นคนพูดคุยเก่งอาจจะถึงขั้นพูดเยอะอัธยาศัยดีเข้ากับคนอื่นได้ง่ายเป็นคนไม่ถือตัวทำงานได้ไวแต่ไม่เน้นงานหนัก', 'P45'),
(146, NULL, NULL, '45', 'เป็นคนที่มีสติมีสมาธิในทุกการพูดคุยว่าจาดูน่าเชื่อถือดูมากประสบการณ์', 'P45'),
(147, NULL, NULL, '46', 'เป็นคนพูดคล่องพูดเก่งและรู้จักพูดรู้จักที่ควรพูดในบทสนทนาถ้าใครได้คุยด้วยจะรู้สึกรักรู้สึกหลงทำให้คนรอบข้างมีความสุขที่สำคัญคือมีพรสวรรค์ในด้านงานขาย', 'P45'),
(148, NULL, NULL, '47', 'พูดจาไม่อ้อมค้อมพูดตรงไม่แคร์ใครคำพูดดูมีพลัง', 'P45'),
(149, NULL, NULL, '48', 'เป็นคนที่พูดโกหกได้อย่างแนบเนียนไม่มีใครจับได้ชอบพูดเอาเรื่องดีเข้าตัวการทำงานจะเน้นการใช้ประโยชน์จากบุคคลรอบตัวให้มากที่สุดไว้พริบดีปรับตัวไวเข้ากับคนง่ายสามารถพลิกจากร้ายเป็นดีจากดีเป็นร้ายได้', 'P45'),
(150, NULL, NULL, '49', 'การสื่อสารอยู่ในเกณฑ์ดีการเจรจาดูน่าเชื่อถือในเรื่องที่เชี่ยวชาญเป็นพิเศษแต่เป็นคนที่พูดไวคิดไวบางครั้งคู่สนทนาจะตามบทสนทนาไม่ทัน', 'P45'),
(151, NULL, NULL, '50', 'ไม่ค่อยมีการตอบโต้ใดๆจากบุคคลนี้ ปฏิสัมพันธ์ทางสังคมติดลบ พูดน้อย เข้าใจยาก', 'P45'),
(152, NULL, NULL, '51', 'พูดน้อยแต่มีเหตุมีผล วาจาน่าเชื่อถือน้ำเสียงนุ่มนวลน่าฟัง มีความเป็นผู้ใหญ่', 'P45'),
(153, NULL, NULL, '52', 'พูดจาสุภาพนุ่มนวล ไม่โหวกเหวกโวยวาย อ่อนน้อมถ่อมตน สร้างความรู้สึกสบายๆ แต่มีความเขินอายกับคนหมู่มาก และอาจะทำให้อำนาจที่มีลดลงได้', 'P45'),
(154, NULL, NULL, '53', 'เป็นคนพูดจาหนักแน่น ตรงไปตรงมา มีความน่าเชื่อถือ มีความสามารถด้านการออกคำสั่ง และเก่งในการขายสินค้าที่มีมูลค่าสูง', 'P45'),
(155, NULL, NULL, '54', 'เป็นคนที่มีสติมีสมาธิในทุกการพูดคุยว่าจาดูน่าเชื่อถือดูมากประสบการณ์', 'P45'),
(156, NULL, NULL, '55', 'พูดน้อยมี สาระขาดลูกเล่นทางด้านการอธิบายคำพูดดูน่าเบื่อเหมือนฟังรายงานวิชาการ', 'P45'),
(157, NULL, NULL, '56', 'การเจรจาสื่อสารดูเป็นธรรมชาติไม่ปลงแต่งรู้สึกสบายใจถ้าได้คุยด้วยคุยได้เรื่อยเรื่อย', 'P45'),
(158, NULL, NULL, '57', 'พูดไม่เก่งเป็นคนพูดน้อยแต่ต่อยหนักถ้าหากได้พูดก็จะพูดแบบตรงตรงซื้อซื่อตามที่ตัวเองคิดแต่หากต้องอธิบายอะไรซักอย่างการอธิบายจะละเอียดมากข้อมูลจะแน่นมาก', 'P45'),
(159, NULL, NULL, '58', 'เป็นคนพูดอะไรแล้วดูอวดภูมิตัวเองเป็นคนดูมีความรู้คำพูดดูมีอำนาจน่าเชื่อถือน่าคอยตามทุกคำพูดที่ออกมาจะรู้สึกว่ามีความเป็นไปได้', 'P45'),
(160, NULL, NULL, '59', 'สื่อสารอธิบายอะไรได้ค่อนข้างละเอียดแต่คนทั่วไปอาจจะไม่เข้าใจได้เป็นคนที่ไม่ค่อยมีมุกตลกอะไรในการเจรจาวาทะศิลป์เหมือนนักวิชาการ', 'P45'),
(161, NULL, NULL, '60', 'ยิ้มแย้มแจ่มใส ดูต้อนรับทุกคนได้ดี สามารถสรรหาเรื่องสนทนาได้เรื่อยๆ', 'P45'),
(162, NULL, NULL, '61', 'วาจาคำพูดดูดี และชอบพูดยกยอตัวเองเป็นหลักบางครั้งอาจรู้สึกว่ามีการประดิษฐ์คำพูดมากจนเกินไป', 'P45'),
(163, NULL, NULL, '62', 'คุยเก่ง คุยสนุก มีมุกหยอดเฮฮาอยู่ตลอดเวลา มักมีน้ำเสียงสบายๆ ตามน้ำเก่ง มีความเป็นทั้งผู้พูด และผู้ฟังอยู่ในตัว ปรับตัวเก่ง', 'P45'),
(164, NULL, NULL, '63', 'เป็นคนช่างเจรจา มีเสน่ห์  สร้างแรงขับเคลื่อนให้กับทุกคนที่อยู่รายล้อมเป็นจุดเด่นของกลุ่มเพื่อนๆ เป็นคนกล้าพูด กล้าทำเป็นคนคล่องตัว เก่งทางด้านการต่อรอง หากตัดสินใจทำอะไรมักไม่มีอะไรขัด มีความสามารถด้านการค้าขาย ปิดการขายเก่ง และทำให้คนที่อยู่รอบตัวรู้สึกสนกกนานเฮฮาได้ แต่บทที่จะจริงจังก็ทำให้คนรอบตัวเครียดได้เหมือนกันนะ', 'P45'),
(165, NULL, NULL, '64', 'เป็นคนพูดคล่องพูดเก่งและรู้จักพูดรู้จักที่ควรพูดในบทสนทนาถ้าใครได้คุยด้วยจะรู้สึกรักรู้สึกหลงทำให้คนรอบข้างมีความสุขที่สำคัญคือมีพรสวรรค์ในด้านงานขาย', 'P45'),
(166, NULL, NULL, '65', 'การเจรจาสื่อสารดูเป็นธรรมชาติไม่ปลงแต่งรู้สึกสบายใจถ้าได้คุยด้วยคุยได้เรื่อยเรื่อย', 'P45'),
(167, NULL, NULL, '66', 'เป็นคนที่คุยเก่งไม่มีสาระแต่คุยสนุกเนื้อหาส่วนมากก็จะไม่พ้นเรื่องของตัวเองสามารถพูดเรื่องยากยากให้เข้าใจง่ายมีคำพูดที่น่าสนใจเก่งด้วยการยกตัวอย่างเก่งในเรื่องการแสดง', 'P45'),
(168, NULL, NULL, '67', 'เป็นคนที่พูดไปเรื่อยเปื่อยน่าเบื่อบางครั้งสื่อสารไม่รู้เรื่องปากไม่ตรงกับใจ', 'P45'),
(169, NULL, NULL, '68', 'ขี้โม้โอ้อวดหน้าใหญ่ใจโตกล้าได้กล้าเสียพูดอะไรไปคนก็สนใจเรียกว่ามีเสน่ห์จากการพูดที่น่าหลงใหล', 'P45'),
(170, NULL, NULL, '69', 'นิสัยดีปรับตัวเก่งเข้าได้กับทุกๆคนมีวาทศิลป์สามารถคุยด้วยได้ทุกเรื่องแต่อย่าไปเชื่อในคำสัญญาอะไรมากเพราะบางครั้งอาจจะรับปากไปแบบส่งส่ง', 'P45'),
(171, NULL, NULL, '70', 'ไม่ค่อยพูด หรือถ้าพูด ก็จะพูดน้อยๆ แต่ต่อยหนัก', 'P45'),
(172, NULL, NULL, '71', 'เป็นคนพูดตรงไปตรงมา ไม่ค่อยมีวาทศิลป์สักเท่าไหร่ มีอำนาจในการควบคุมคน ขึงขังจนตึงเครียด', 'P45'),
(173, NULL, NULL, '72', 'ขาดความมั่นอกมั่นใจในการพูด มักมีปัญหาเรื่องการเจรจาต่อรอง ขาดความน่าเชื่อถือ แม้ข้อมูลจะเป็นความจริง ไม่สามารถควบคุมลูกน้องหรือบริวารได้มักเป็นผู้ฟังที่ดี', 'P45'),
(174, NULL, NULL, '73', 'การเจรจาตรงไปตรงมา พูดห้วนไม่ค่อยมีหางเสียง ขาดลูกเล่นในการใช้คำพูด บทสนทนาดูจริงจัง ขาดเสน่ห์', 'P45'),
(175, NULL, NULL, '74', 'พูดจาไม่อ้อมค้อมพูดตรงไม่แคร์ใครคำพูดดูมีพลัง', 'P45'),
(176, NULL, NULL, '75', 'พูดไม่เก่งเป็นคนพูดน้อยแต่ต่อยหนักถ้าหากได้พูดก็จะพูดแบบตรงตรงซื้อซื่อตามที่ตัวเองคิดแต่หากต้องอธิบายอะไรซักอย่างการอธิบายจะละเอียดมากข้อมูลจะแน่นมาก', 'P45'),
(177, NULL, NULL, '76', 'เป็นคนที่พูดไปเรื่อยเปื่อยน่าเบื่อบางครั้งสื่อสารไม่รู้เรื่องปากไม่ตรงกับใจ', 'P45'),
(178, NULL, NULL, '77', 'พูดขวานผ่าซากขาดวาทะศิลป์พูดคนห้วนชอบตัดบทถามคำตอบคำ', 'P45'),
(179, NULL, NULL, '78', 'กล้าพูดกล้าสื่อสารคำพูดดูหนักแน่นดูจริงจังมีอำนาจเป็นคนแฟร์แฟร์', 'P45'),
(180, NULL, NULL, '79', 'เป็นคนพูดน้อยเข้าสังคมไม่เก่งจะไม่เริ่มบทสนทนาก่อนเป็นคนพูดแข็งแข็งดูจริงจังในการสื่อสารอธิบายไม่เก่งเข้าใจยาก', 'P45'),
(181, NULL, NULL, '80', 'เป็นคนทำอะไรดูมั่นใจมากๆ และไม่แคร์ใครที่ไหน ไม่ระวังในการพูด พูดไม่คิด ขี้โอ่ ขี้โม้', 'P45'),
(182, NULL, NULL, '81', 'พูดจาโผงผางไม่เกรงใจใคร พูดตรง พูดแรง กดดัน ไม่ไว้หน้าใคร ชอบโอ้อวด', 'P45'),
(183, NULL, NULL, '82', 'คำพูดดูเหวี่ยง ดูหยิ่งยโส ไม่แคร์ใคร เป็นคนทำอะไรเร็ว ทำอะไรได้โดยไม่เกรงใจใคร ชอบคุยโวโอ้อวด ในสิ่งที่ตนมีและยังไม่มี แต่หากมีเวลาเตรียมตัวก็สามารถประดิษฐ์คำพูดให้ดูดี และมีเสน่ห์ได้', 'P45'),
(184, NULL, NULL, '83', 'พูดเสียงดังฟังชัด บางครั้งเหมือนตะโกน คำพูดเด็ดขาด คำไหนคำนั้น เป็นคนปากว่ามือถึง ควบคุมอารมณ์ไม่เก่ง', 'P45'),
(185, NULL, NULL, '84', 'เป็นคนที่พูดโกหกได้อย่างแนบเนียนไม่มีใครจับได้ชอบพูดเอาเรื่องดีเข้าตัวการทำงานจะเน้นการใช้ประโยชน์จากบุคคลรอบตัวให้มากที่สุดไว้พริบดีปรับตัวไวเข้ากับคนง่ายสามารถพลิกจากร้ายเป็นดีจากดีเป็นร้ายได้', 'P45'),
(186, NULL, NULL, '85', 'เป็นคนพูดอะไรแล้วดูอวดภูมิตัวเองเป็นคนดูมีความรู้คำพูดดูมีอำนาจน่าเชื่อถือน่าคอยตามทุกคำพูดที่ออกมาจะรู้สึกว่ามีความเป็นไปได้', 'P45'),
(187, NULL, NULL, '86', 'ขี้โม้โอ้อวดหน้าใหญ่ใจโตกล้าได้กล้าเสียพูดอะไรไปคนก็สนใจเรียกว่ามีเสน่ห์จากการพูดที่น่าหลงใหล', 'P45'),
(188, NULL, NULL, '87', 'กล้าพูดกล้าสื่อสารคำพูดดูหนักแน่นดูจริงจังมีอำนาจเป็นคนแฟร์แฟร์', 'P45'),
(189, NULL, NULL, '88', 'คำพูดหนักแน่นกล้าพูดกล้าเสนอความคิดซื้อใจคนเก่งบางครั้งดูขี้โม้มากพูดอะไรดูใหญ่กว่าความเป็นจริง', 'P45'),
(190, NULL, NULL, '89', 'มีคำพูดที่จริงจังชัดเจนพูดตรงไปตรงมาตามความรู้สึกน้ำเสียงดูมีเสน่ห์ดึงดูดน่าฟังน่าเชื่อถือน่ายำเกรง', 'P45'),
(191, NULL, NULL, '90', 'เป็นคนพูดหรือสื่อสารอะไรที่คนปกติฟังไม่รู้เรื่อง ใช้คำพูดหรือภาษาแปลกๆ พูดเรื่องเข้าใจง่ายให้เข้าใจยากได้ แต่คุยกันคนต่างชาติเก่ง เพราะมีความกล้าที่จะสื่อสาร', 'P45'),
(192, NULL, NULL, '91', 'พูดจาคล่องแคล่ว มีประเด็นหัวข้อชัดเจน ต่อรองเก่ง มีทักษะการ สื่อสารทางธุรกิจ สื่อสารกับต่างชาติ มีความคล่องตัวว่องไว มั่นใจในตัวเอง กล้าแสดงออก', 'P45'),
(193, NULL, NULL, '92', 'อัธยาศัยดี คุยเก่ง กล้าที่จะคิดและกล้าที่จะพูด แต่เป็นคนที่ไม่ค่อยกล้าลงมือทำอะไรจริงๆมากนัก ไม่สไตล์การพูดเป็นของตัวเอง และมักทำให้คนที่คุยด้วยจดจำได้', 'P45'),
(194, NULL, NULL, '93', 'พูดเร็ว คิดเร็ว ทำเร็ว คนอื่นตามไม่ทัน จะเป็นคนพูดตรงมากๆ ไม่เกรงใจใคร เป็นคำพูดที่ฟังง่าย ชัดเจน แต่เต็มไปด้วยพลังและอำนาจในน้ำเสียงนั้นๆ คนรอบๆตัวอาจจะมองว่าเป็นคำพูดของคนที่ชอบใช้อารมณ์', 'P45'),
(195, NULL, NULL, '94', 'การสื่อสารอยู่ในเกณฑ์ดีการเจรจาดูน่าเชื่อถือในเรื่องที่เชี่ยวชาญเป็นพิเศษแต่เป็นคนที่พูดไวคิดไวบางครั้งคู่สนทนาจะตามบทสนทนาไม่ทัน', 'P45'),
(196, NULL, NULL, '95', 'สื่อสารอธิบายอะไรได้ค่อนข้างละเอียดแต่คนทั่วไปอาจจะไม่เข้าใจได้เป็นคนที่ไม่ค่อยมีมุกตลกอะไรในการเจรจาวาทะศิลป์เหมือนนักวิชาการ', 'P45'),
(197, NULL, NULL, '96', 'นิสัยดีปรับตัวเก่งเข้าได้กับทุกๆคนมีวาทศิลป์สามารถคุยด้วยได้ทุกเรื่องแต่อย่าไปเชื่อในคำสัญญาอะไรมากเพราะบางครั้งอาจจะรับปากไปแบบส่งส่ง', 'P45'),
(198, NULL, NULL, '97', 'เป็นคนพูดน้อยเข้าสังคมไม่เก่งจะไม่เริ่มบทสนทนาก่อนเป็นคนพูดแข็งแข็งดูจริงจังในการสื่อสารอธิบายไม่เก่งเข้าใจยาก', 'P45'),
(199, NULL, NULL, '98', 'มีคำพูดที่จริงจังชัดเจนพูดตรงไปตรงมาตามความรู้สึกน้ำเสียงดูมีเสน่ห์ดึงดูดน่าฟังน่าเชื่อถือน่ายำเกรง', 'P45'),
(200, NULL, NULL, '99', 'เป็นคนพูดเร็วทำให้คู่สนทนาจับใจความไม่ทันหรือฟังแล้วไม่เข้าใจมีไหวพริบการเข้าสังคมสูงแก้ปัญหาเฉพาะหน้าเก่ง', 'P45'),
(201, NULL, NULL, '0', 'มีความคิดไม่เหมือนใคร หลุดโลก ไม่ยึดติดกับหลักการหรือเหตุผลใดๆ', 'P67'),
(202, NULL, NULL, '1', 'คิดว่าตนเองอยู่คนเดียว ทำได้ทุกอย่างโดยไม่พึ่งใคร มีมุมมองความคิดที่ค่อนข้าแคบ ไม่รับฟังความเห็นของผู้อื่น', 'P67'),
(203, NULL, NULL, '2', 'มีความคิดค่อนข้างโลกสวย ค่อนข้างสับสน ไม่มั้นใจในตัวเอง ความคิดดูฟุ้งซ่าน จับประเด็นต่างๆได้ยาก ไม่เด็ดขาด แต่มีพรสวรรค์ ด้านงานศิลป์', 'P67'),
(204, NULL, NULL, '3', 'ทำงานไม่รอบคอบ ขาดสติยั้งคิด แต่ทำงานเก่ง คิดไว แก้ไขสิ่งต่างๆได้เร็ว แต่มักจะเป็น แก้ไขแบบผักชีโรยหน้าไม่ใช่การแก้ไขแบบยั่งยืน', 'P67'),
(205, NULL, NULL, '4', 'มีแนวคิดที่แตกต่างจากคนอื่น และเข้าใจอะไรได้อย่างทะลุปรุโปร่ง แต่ในมุมมองคนอื่นๆ ก็อาจจะมองว่าเป็นคนเพ้อเจ้อฟุ้งซ่าน ชอบสร้างเรื่องโกหก', 'P67'),
(206, NULL, NULL, '5', 'มีแนวคิดและมุมมองไม่เหมือนใคร มองอะไรได้แปลกและแตกต่าง เป็นคนคิดในเชิงลึกและกว้าง แต่มักคิดในแง่ลบมากกว่าแง่บวก', 'P67'),
(207, NULL, NULL, '6', 'มีมุมมองเรื่องความคิดสร้างสรรค์มากมาย คิดไม่เหมือนใคร ชอบในสิ่งแปลก และแตกต่าง  ไม่เหมือนใคร ใช้อารมณ์อยู่เหนือเหตุผล', 'P67'),
(208, NULL, NULL, '7', 'มีความคิดขวางโลก ไม่ฟังความคิดเห็นคนอื่น  เป็นคนเครียด ซีเรียส ตลอดเวลาและย้ำคิดย้ำทำ ฟุ้งซ่าน มีความคิดที่ละเอียดมาก แต่มักจะละเอียดในเรื่องที่ไม่เป็นเรื่อง แต่ก็ถือเป็นเรื่องใหญ่สำหรับเขา', 'P67'),
(209, NULL, NULL, '8', 'คิดอะไรไว้ใหญ่เกินจริง เวอร์วังอลังการ แต่มักจะคิดแต่ผลสำเร็จ ไม่ยอมคิดเรื่องวิธีการและการปฏิบัติจริง มีแต่ความเพ้อฝัน ที่ไม่จริง', 'P67'),
(210, NULL, NULL, '9', 'มีความคิดที่หลุดโลก มุมมองความคิดแปลกและกล้าที่จะแตกต่าง ไม่เหมือนคนอื่นเขา แต่ติดมนเรื่องของความงมงาย หากได้คิดแบบใดแล้วก็จะไม่เปลี่ยนแปลง จนกว่าจะได้ไปเจอสิ่งอื่นที่ถูกใจ จึงจะไปงมงายสิ่งอื่นเรื่อยๆ', 'P67'),
(211, NULL, NULL, '10', 'คิดว่าตนเองอยู่คนเดียว ทำได้ทุกอย่างโดยไม่พึ่งใคร มีมุมมองความคิดที่ค่อนข้าแคบ ไม่รับฟังความเห็นของผู้อื่น', 'P67'),
(212, NULL, NULL, '11', 'มีความมั่นใจในสิ่งที่ตนคิดสูงมากๆ จนไม่รับฟังความเห็นของผู้อื่น ตัดสินใจเด็ดขาดชัดเจน', 'P67'),
(213, NULL, NULL, '12', 'ชอบคิดหยุมหยิม โดยเฉพาะกับลูกน้องบริวาร หรือแม้แต่คนใกล้ชิด เวลางานจะไปได้ด้วยดีก็มักจะคิดอะไรเล็กๆน้อยๆมาตัด มาตัดกำลังใจ จู้จี้จุกจิก', 'P67'),
(214, NULL, NULL, '13', 'เป็นคนไม่รอบคอบ ขาดสติได้ง่าย มองอะไรง่ายๆ และทำแบบลวกๆ', 'P67'),
(215, NULL, NULL, '14', 'มีความคิดเป็ผู้นำ มองโลกไม่เหมือนใคร หัวคิดเป็นนักพัฒนาธุระกิจ หัวก้าวหน้า ทันข่างทันโลก แต่อาจจะไม่ค่อยรอบคอบนัก', 'P67'),
(216, NULL, NULL, '15', 'คิดอะไรเป็นระบบและมีระเบียบแบบแผน มีความรอบคอบดี ทุกแผนการสามารถใช้ได้จริง มีความจะดีภาวะผู้นำสูง ตัดสันใจอะไรไม่เคยพลาด', 'P67'),
(217, NULL, NULL, '16', 'เป็นคนคิดอะไรหลายด้านหลายมุมมองเนื่องจากต้องการความสมบูรณ์แบบ เข้าใจมุมมองของลูกค้าได้เป็นอย่างยิ่ง แต่อาจจะมีปัญหาตัดสินใจช้า เลือกเยอะเรื่องมาก', 'P67'),
(218, NULL, NULL, '17', 'มีความคิดที่ค่อนข้างรอบคอบทำงานเก่ง บ้างาน จริงจังมาก ขณะที่โฟกัสกับอะไรบางอย่างจะมีสมาธิมากๆ และต้องระวังโรคเครียดเป็นพิเศษ', 'P67'),
(219, NULL, NULL, '18', 'คิดแต่เรื่องของผลประโยชน์และคำว่า\"ได้\"เป็นคนฉลาดแกมโกง หัวไว กล้าคิดกล้าทำ กล้าได้กล้าเสีย', 'P67'),
(220, NULL, NULL, '19', 'หัวคิดสมัยใหม่ วิสัยทัศน์ไกล รักการพัฒนาชอบการเปลี่ยนแปลง ไปในทางที่ดีขึ้น', 'P67'),
(221, NULL, NULL, '20', 'มีความคิดค่อนข้างโลกสวย ค่อนข้างสับสน ไม่มั้นใจในตัวเอง ความคิดดูฟุ้งซ่าน จับประเด็นต่างๆได้ยาก ไม่เด็ดขาด แต่มีพรสวรรค์ ด้านงานศิลป์', 'P67'),
(222, NULL, NULL, '21', 'ชอบคิดหยุมหยิม โดยเฉพาะกับลูกน้องบริวาร หรือแม้แต่คนใกล้ชิด เวลางานจะไปได้ด้วยดีก็มักจะคิดอะไรเล็กๆน้อยๆมาตัด มาตัดกำลังใจ จู้จี้จุกจิก', 'P67'),
(223, NULL, NULL, '22', 'ไม่มั่นใจในตัวเองโลเล คิดวกวน จินตนาการสูง เชื่อคนง่าย มักตัดสินใจอะไรตามอารมณ์', 'P67'),
(224, NULL, NULL, '23', 'หัวไวฉลาด สมองอัจฉริยะ มองและคิดอะไรไม่เหมือนคนอื่นกล้าคิดกล้าทำ กล้าจะเริ่มต้นสิ่งใหม่ๆ ไอเดียดี', 'P67'),
(225, NULL, NULL, '24', 'มักไม่ค่อยมีความคิดเป็นของตัวเอง เชื่อคนง่าย ใครว่ายังไงก็ว่าตาม แต่สิ่งที่เก่งคือการจับสัมผัสความรู้สึก หรือคาดเดาความรู้สึกของคนอื่นๆ มักเป็นฝ่ายสนับสนุนมากกว่า', 'P67'),
(226, NULL, NULL, '25', 'มีความสมดุลในเรื่องของอีโก้ ยอมลดทิฐิหรือความคิดของตัวเองเพื่อรับฟังความคิดเห็นคนอื่นมากขึ้น หากว่าดีกว่าก็พร้อมจะปรับเปลี่ยนและยอมรับผล อาจจะไม่ใช่คนเด็ดขาด เพราะเป็นคนตัดสินใจช้า ไม่ชัดเจน พร้อมทั้งขาดคุณสมบัติของความเป็นผู้นำ', 'P67'),
(227, NULL, NULL, '26', 'เข้าอกเข้าใจผู้อื่น มีมนุษย์สัมพันธ์ที่ดีกับบริวาร และบุคคลรอบตัว น่ารักสดใส เป็นคนคิดบวก โลกสวย มองโลกในแง่ดีเกินไป คิดอะไรง่ายๆ', 'P67'),
(228, NULL, NULL, '27', 'เป็นคนคิดอะไรตรงไปตรงมา คิดง่ายๆ ไม่ซับซ้อนหัวอ่อน และมีเกณฑ์ถูกหลอกได้ง่ายๆ มักไม่มั่นใจในความคิด และความสามารถของตนเอง', 'P67'),
(229, NULL, NULL, '28', 'ไม่ได้คิดว่าตัวเองฉบาดที่สุด แต่ฉันไม่เคยผิด มีความคิดล้ำๆออกมาตลอด เป็นคนช่างจินตนาการ หัวคิดก้าวหน้า กล้าทำคิดไวทำไว ใช้อารมณ์ในการตัดสินใจ', 'P67'),
(230, NULL, NULL, '29', 'จินตนาการดี หัวคิดสร้างสรรค์ แปลกแหวกแนวดี มีความเข้าใจในอารมณ์และสื่อสารออกมาได้ออกดีหากฝึกฝนจินตนาการให้ถูกทาง มีโอกาสรุ่งเรือง', 'P67'),
(231, NULL, NULL, '30', 'ทำงานไม่รอบคอบ ขาดสติยั้งคิด แต่ทำงานเก่ง คิดไว แก้ไขสิ่งต่างๆได้เร็ว แต่มักจะเป็น แก้ไขแบบผักชีโรยหน้าไม่ใช่การแก้ไขแบบยั่งยืน', 'P67'),
(232, NULL, NULL, '31', 'เป็นคนไม่รอบคอบ ขาดสติได้ง่าย มองอะไรง่ายๆ และทำแบบลวกๆ', 'P67'),
(233, NULL, NULL, '32', 'หัวไวฉลาด สมองอัจฉริยะ มองและคิดอะไรไม่เหมือนคนอื่นกล้าคิดกล้าทำ กล้าจะเริ่มต้นสิ่งใหม่ๆ ไอเดียดี', 'P67'),
(234, NULL, NULL, '33', 'เป็นคนฉลาด ไหวพริบดี แต่ไม่รอบคอบ ไม่คิดซับซ้อน คิดแต่จะทำตามใจตนเอง ไม่รับฟังความคิดเห็นของผู้อื่น เป็นคนที่ทำก่อนแล้วค่อยคิด เก่งในงานปฏิบัติ มากกว่าทฤษฎี', 'P67'),
(235, NULL, NULL, '34', 'คิดตรงไปตรงมา ไม่ซับซ้อนเห็นอะไรก็คิดแบบนั้นตัดสินใจเด็ดขาด ', 'P67'),
(236, NULL, NULL, '35', 'เป็นคนที่มีสติรอบคอบ และไหวพริบดี มีเป้าหมาย ความก้าวหน้าในชีวิต มีความมุ่งมั่น จริงจัง เด็ดขาดกล้าได้กล้าเสีย', 'P67'),
(237, NULL, NULL, '36', 'มีความคิดสร้างสรรค์สูง ไอเดียดี มีความครีเอทีฟ กล้าที่จะเริ่มสิ่งใหม่ๆ คิดว่าทุกอย่างเป็นเรื่องง่ายๆ สำหรับเขา และทุกๆคนสามารถทำได้', 'P67'),
(238, NULL, NULL, '37', 'เป็นคนคิดอะไรตรงๆทื่อๆ มีความละเอียดรอบคอบสูงแต่ไม่ถนัดในการประยุกต์ใช้งาน เน้นการรับคำสั่งแล้วทำตามคำสั่งจึงจะเหมาะสม', 'P67'),
(239, NULL, NULL, '38', 'เป็นคนคิดอะไรเร็วไม่รอบคอบ กล้าได้กล้าเสียแม้จะอันตรายก็ตาม มีเป้าหมายชัดเจน และไม่ฟังคำแนะนำของใคร', 'P67'),
(240, NULL, NULL, '39', 'เป็นคนที่มีเป้าหมายชัดเจน คิดอะไรทีละหลายอย่าง มุ่งมั่น และตั้งใจในสิ่งที่คิดไว้ เมื่อได้ข้อสรุปแล้ว จะตัดสินใจ อย่างเด็ดขาด และพร้อมที่จะทำใรสิ่งที่คิดให้ดีที่สุด', 'P67'),
(241, NULL, NULL, '40', 'มีแนวคิดที่แตกต่างจากคนอื่น และเข้าใจอะไรได้อย่างทะลุปรุโปร่ง แต่ในมุมมองคนอื่นๆ ก็อาจจะมองว่าเป็นคนเพ้อเจ้อฟุ้งซ่าน ชอบสร้างเรื่องโกหก', 'P67'),
(242, NULL, NULL, '41', 'มีความคิดเป็ผู้นำ มองโลกไม่เหมือนใคร หัวคิดเป็นนักพัฒนาธุระกิจ หัวก้าวหน้า ทันข่างทันโลก แต่อาจจะไม่ค่อยรอบคอบนัก', 'P67'),
(243, NULL, NULL, '42', 'มักไม่ค่อยมีความคิดเป็นของตัวเอง เชื่อคนง่าย ใครว่ายังไงก็ว่าตาม แต่สิ่งที่เก่งคือการจับสัมผัสความรู้สึก หรือคาดเดาความรู้สึกของคนอื่นๆ มักเป็นฝ่ายสนับสนุนมากกว่า', 'P67'),
(244, NULL, NULL, '43', 'คิดตรงไปตรงมา ไม่ซับซ้อนเห็นอะไรก็คิดแบบนั้นตัดสินใจเด็ดขาด ', 'P67'),
(245, NULL, NULL, '44', 'เป็นคนที่มีความคิดในหัวเยอะแยะมากมายข้อมูลข่าวสารมีมากจนล้นแล้วยังคิดพัฒนาต่อยอดอีกด้วยแต่บางครั้งไอเดียที่เยอะเกินไปก็อาจจะทำให้เป็นคนไม่เด็ดขาดตัดสินใจอะไรไม่ค่อยได้', 'P67'),
(246, NULL, NULL, '45', 'เป็นคนบุคลิกคิดอะไรละเอียดลึกซึ้งมีทั้งความรอบคอบและสามารถพลิกแพลงหรือดัดแปลงพัฒนาองค์ความรู้ใหม่ใหม่อยู่ตลอดเวลาตามกระแสโลกและพร้อมที่จะปรับเปลี่ยนทุกอย่างให้ดีขึ้น', 'P67'),
(247, NULL, NULL, '46', 'มีความคิดเชิงสร้างสรรค์และการประยุกต์คันดีเยี่ยมเก่งในการตลาดเข้าอกเข้าใจมุมมองของผู้บริโภคเป็นอย่างดี', 'P67'),
(248, NULL, NULL, '47', 'เป็นคนที่ทำงานได้ดีหากมีจุดประสงค์ชัดเจนและจะทำทุกวิถีทางเพื่อให้สำเร็จตามเป้าหมายที่กำหนดไว้มากทำไมตามขั้นตอนระเบียบการหยุมหยิมในรายละเอียดเล็กๆน้อยๆจนถึงขั้นจุกจิก', 'P67'),
(249, NULL, NULL, '48', 'เป็นคนที่คิดพลิกแพลงได้หลากหลายไม่ยึดติดกับสิ่งใดใดไม่อยู่ในกรอบหรือกฎเกณฑ์ปรับเปลี่ยนทุกอย่างแม้แต่ตัวตนของตนเองได้เป็นอย่างดี', 'P67'),
(250, NULL, NULL, '49', 'มีความคิดหัวพัฒนาความคิดแปลกแหวกแนวไม่เหมือนใครว่าคิดนักประดิษฐ์', 'P67'),
(251, NULL, NULL, '50', 'มีแนวคิดและมุมมองไม่เหมือนใคร มองอะไรได้แปลกและแตกต่าง เป็นคนคิดในเชิงลึกและกว้าง แต่มักคิดในแง่ลบมากกว่าแง่บวก', 'P67'),
(252, NULL, NULL, '51', 'คิดอะไรเป็นระบบและมีระเบียบแบบแผน มีความรอบคอบดี ทุกแผนการสามารถใช้ได้จริง มีความจะดีภาวะผู้นำสูง ตัดสันใจอะไรไม่เคยพลาด', 'P67'),
(253, NULL, NULL, '52', 'มีความสมดุลในเรื่องของอีโก้ ยอมลดทิฐิหรือความคิดของตัวเองเพื่อรับฟังความคิดเห็นคนอื่นมากขึ้น หากว่าดีกว่าก็พร้อมจะปรับเปลี่ยนและยอมรับผล อาจจะไม่ใช่คนเด็ดขาด เพราะเป็นคนตัดสินใจช้า ไม่ชัดเจน พร้อมทั้งขาดคุณสมบัติของความเป็นผู้นำ', 'P67'),
(254, NULL, NULL, '53', 'เป็นคนที่มีสติรอบคอบ และไหวพริบดี มีเป้าหมาย ความก้าวหน้าในชีวิต มีความมุ่งมั่น จริงจัง เด็ดขาดกล้าได้กล้าเสีย', 'P67'),
(255, NULL, NULL, '54', 'เป็นคนบุคลิกคิดอะไรละเอียดลึกซึ้งมีทั้งความรอบคอบและสามารถพลิกแพลงหรือดัดแปลงพัฒนาองค์ความรู้ใหม่ใหม่อยู่ตลอดเวลาตามกระแสโลกและพร้อมที่จะปรับเปลี่ยนทุกอย่างให้ดีขึ้น', 'P67'),
(256, NULL, NULL, '55', 'คิดอ่านเป็นระบบเข้าใจหลายหลายสิ่งอย่างลึกซึ้งใช้เวลาในการวิเคราะห์สิ่งต่างๆรอบตัวค่อนข้างนานทุกๆการกระทำจะต้องมีหลักการและเหตุผลรองรับมีสมาธิมากและสามารถทำงานที่มีความละเอียดสูงได้ดี', 'P67'),
(257, NULL, NULL, '56', 'ไม่คิดอะไรมากขอสบายสบายเรื่อยเรื่อยก็พอไม่เหมาะสำหรับนักพัฒนาหรือคนที่จะเริ่มต้นบุกเบิกธุรกิจใหม่ใหม่เพราะอิทธิพลเลขคู่นี้จะทำให้ชื่อยเอามากๆ', 'P67'),
(258, NULL, NULL, '57', 'เป็นคนคิดเยอะคิดแบบละเอียดในบางครั้งเหมือนคนขวางโลกคิดไม่เหมือนคนอื่นอาจจะมีความขัดแย้งทางความคิดกับผู้หลักผู้ใหญ่', 'P67'),
(259, NULL, NULL, '58', 'เป็นคนฉลาดรอบคอบจนถึงขั้นระแวงวางแผนได้แนบเนียนเต็มไปด้วยเล่ห์กลฉลาดแกมโกง', 'P67'),
(260, NULL, NULL, '59', 'สามารถทำความเข้าใจความรู้ต่างๆได้อย่างลึกซึ้งจนถึงแก่นแท้เรียบเรียงและอธิบายความรู้ที่มีได้อย่างเป็นขั้นเป็นตอนดูมีที่มาที่ไปพร้อมทั้งยังสามารถนำความรู้ที่มีไปประยุกต์ใช้ดัดแปลงต่อยอดได้อีกมากมาย', 'P67'),
(261, NULL, NULL, '60', 'มีมุมมองเรื่องความคิดสร้างสรรค์มากมาย คิดไม่เหมือนใคร ชอบในสิ่งแปลก และแตกต่าง  ไม่เหมือนใคร ใช้อารมณ์อยู่เหนือเหตุผล', 'P67'),
(262, NULL, NULL, '61', 'เป็นคนคิดอะไรหลายด้านหลายมุมมองเนื่องจากต้องการความสมบูรณ์แบบ เข้าใจมุมมองของลูกค้าได้เป็นอย่างยิ่ง แต่อาจจะมีปัญหาตัดสินใจช้า เลือกเยอะเรื่องมาก', 'P67'),
(263, NULL, NULL, '62', 'เข้าอกเข้าใจผู้อื่น มีมนุษย์สัมพันธ์ที่ดีกับบริวาร และบุคคลรอบตัว น่ารักสดใส เป็นคนคิดบวก โลกสวย มองโลกในแง่ดีเกินไป คิดอะไรง่ายๆ', 'P67'),
(264, NULL, NULL, '63', 'มีความคิดสร้างสรรค์สูง ไอเดียดี มีความครีเอทีฟ กล้าที่จะเริ่มสิ่งใหม่ๆ คิดว่าทุกอย่างเป็นเรื่องง่ายๆ สำหรับเขา และทุกๆคนสามารถทำได้', 'P67'),
(265, NULL, NULL, '64', 'มีความคิดเชิงสร้างสรรค์และการประยุกต์คันดีเยี่ยมเก่งในการตลาดเข้าอกเข้าใจมุมมองของผู้บริโภคเป็นอย่างดี', 'P67'),
(266, NULL, NULL, '65', 'ไม่คิดอะไรมากขอสบายสบายเรื่อยเรื่อยก็พอไม่เหมาะสำหรับนักพัฒนาหรือคนที่จะเริ่มต้นบุกเบิกธุรกิจใหม่ใหม่เพราะอิทธิพลเลขคู่นี้จะทำให้ชื่อยเอามากๆ', 'P67'),
(267, NULL, NULL, '66', 'ไม่ได้เก่งวิเคราะห์หรือดัดแปลงแต่มีความคิดสร้างสรรค์ดีเป็นคนตามเทรนทันแฟชั่นวิเคราะห์และเข้าใจถึงอารมณ์ของบุคคลได้เก่งรู้จักบริหารคน', 'P67'),
(268, NULL, NULL, '67', 'ยึดติดกับความคิดเดิมๆคิดวนเวียนอยู่กับที่หัวช้าไม่เปิดรับความคิดใหม่ใหม่เข้ามาในหัว', 'P67'),
(269, NULL, NULL, '68', 'คิดทำอะไรเกินตัวทำทุกวิถีทางเพื่อให้ได้มาซึ่งสิ่งที่ตัวเองต้องการไม่ว่าจะเงินทองหรือความรักไม่ได้ใส่ใจว่าสิ่งไหนผิดหรือถูก', 'P67'),
(270, NULL, NULL, '69', 'เป็นคนที่มีไอเดียที่ดีมีความคิดสร้างสรรค์รอบด้านคิดเล่นเล่นสนุกสนุกแต่อาจจะกลายเป็นการสร้างสรรค์หรือช่องทางหาเงินได้โดยไม่รู้ตัวมีหัวทางด้านศิลปะอารมณ์ศิลปิน', 'P67'),
(271, NULL, NULL, '70', 'มีความคิดขวางโลก ไม่ฟังความคิดเห็นคนอื่น  เป็นคนเครียด ซีเรียส ตลอดเวลาและย้ำคิดย้ำทำ ฟุ้งซ่าน มีความคิดที่ละเอียดมาก แต่มักจะละเอียดในเรื่องที่ไม่เป็นเรื่อง แต่ก็ถือเป็นเรื่องใหญ่สำหรับเขา', 'P67'),
(272, NULL, NULL, '71', 'มีความคิดที่ค่อนข้างรอบคอบทำงานเก่ง บ้างาน จริงจังมาก ขณะที่โฟกัสกับอะไรบางอย่างจะมีสมาธิมากๆ และต้องระวังโรคเครียดเป็นพิเศษ', 'P67'),
(273, NULL, NULL, '72', 'เป็นคนคิดอะไรตรงไปตรงมา คิดง่ายๆ ไม่ซับซ้อนหัวอ่อน และมีเกณฑ์ถูกหลอกได้ง่ายๆ มักไม่มั่นใจในความคิด และความสามารถของตนเอง', 'P67'),
(274, NULL, NULL, '73', 'เป็นคนคิดอะไรตรงๆทื่อๆ มีความละเอียดรอบคอบสูงแต่ไม่ถนัดในการประยุกต์ใช้งาน เน้นการรับคำสั่งแล้วทำตามคำสั่งจึงจะเหมาะสม', 'P67'),
(275, NULL, NULL, '74', 'เป็นคนที่ทำงานได้ดีหากมีจุดประสงค์ชัดเจนและจะทำทุกวิถีทางเพื่อให้สำเร็จตามเป้าหมายที่กำหนดไว้มากทำไมตามขั้นตอนระเบียบการหยุมหยิมในรายละเอียดเล็กๆน้อยๆจนถึงขั้นจุกจิก', 'P67'),
(276, NULL, NULL, '75', 'เป็นคนคิดเยอะคิดแบบละเอียดในบางครั้งเหมือนคนขวางโลกคิดไม่เหมือนคนอื่นอาจจะมีความขัดแย้งทางความคิดกับผู้หลักผู้ใหญ่', 'P67'),
(277, NULL, NULL, '76', 'ยึดติดกับความคิดเดิมๆคิดวนเวียนอยู่กับที่หัวช้าไม่เปิดรับความคิดใหม่ใหม่เข้ามาในหัว', 'P67'),
(278, NULL, NULL, '77', 'เป็นคนคิดมากเป็นคนย้ำคิดย้ำทำละเอียดมากจนเกินไปในบางครั้งจุกจิกเครียดในเรื่องงานเรื่องการใช้ชีวิตในอนาคตตัดสินใจช้ายึดมั่นในความคิดตัวเอง', 'P67'),
(279, NULL, NULL, '78', 'เป็นนักคิดนักพัฒนาหัวนักธุรกิจคิดการใหญ่กล้าได้กล้าเสียกล้าลงทุน', 'P67'),
(280, NULL, NULL, '79', 'คิดวิเคราะห์ได้ถึงรักถึงแก่นเพราะมีความสามารถในการเจาะรายละเอียดข้อมูลพร้อมทั้งสามารถวิเคราะห์ได้เป็นอย่างดีจึงเป็นนักวางแผนที่ละเอียดถี่ถ้วนและนำไปใช้งานได้จริงเน้นการวางแผนระยะยาวเป็นความคิดที่ไม่ตกยุค', 'P67'),
(281, NULL, NULL, '80', 'คิดอะไรไว้ใหญ่เกินจริง เวอร์วังอลังการ แต่มักจะคิดแต่ผลสำเร็จ ไม่ยอมคิดเรื่องวิธีการและการปฏิบัติจริง มีแต่ความเพ้อฝัน ที่ไม่จริง', 'P67'),
(282, NULL, NULL, '81', 'คิดแต่เรื่องของผลประโยชน์และคำว่า\"ได้\"เป็นคนฉลาดแกมโกง หัวไว กล้าคิดกล้าทำ กล้าได้กล้าเสีย', 'P67'),
(283, NULL, NULL, '82', 'ไม่ได้คิดว่าตัวเองฉบาดที่สุด แต่ฉันไม่เคยผิด มีความคิดล้ำๆออกมาตลอด เป็นคนช่างจินตนาการ หัวคิดก้าวหน้า กล้าทำคิดไวทำไว ใช้อารมณ์ในการตัดสินใจ', 'P67'),
(284, NULL, NULL, '83', 'เป็นคนคิดอะไรเร็วไม่รอบคอบ กล้าได้กล้าเสียแม้จะอันตรายก็ตาม มีเป้าหมายชัดเจน และไม่ฟังคำแนะนำของใคร', 'P67'),
(285, NULL, NULL, '84', 'เป็นคนที่คิดพลิกแพลงได้หลากหลายไม่ยึดติดกับสิ่งใดใดไม่อยู่ในกรอบหรือกฎเกณฑ์ปรับเปลี่ยนทุกอย่างแม้แต่ตัวตนของตนเองได้เป็นอย่างดี', 'P67'),
(286, NULL, NULL, '85', 'เป็นคนฉลาดรอบคอบจนถึงขั้นระแวงวางแผนได้แนบเนียนเต็มไปด้วยเล่ห์กลฉลาดแกมโกง', 'P67'),
(287, NULL, NULL, '86', 'คิดทำอะไรเกินตัวทำทุกวิถีทางเพื่อให้ได้มาซึ่งสิ่งที่ตัวเองต้องการไม่ว่าจะเงินทองหรือความรักไม่ได้ใส่ใจว่าสิ่งไหนผิดหรือถูก', 'P67'),
(288, NULL, NULL, '87', 'เป็นนักคิดนักพัฒนาหัวนักธุรกิจคิดการใหญ่กล้าได้กล้าเสียกล้าลงทุน', 'P67'),
(289, NULL, NULL, '88', 'มีเล่ห์เหลี่ยมได้ความคิดมากมายฉลาดแกมโกงคิดเฉพาะเรื่องผลประโยชน์', 'P67'),
(290, NULL, NULL, '89', 'มุมมองในเรื่องการปกครองที่ดีมีความเด็ดขาดความคิดมีรูปธรรมคิดการใหญ่วางแผนเพื่ออนาคตกล้าได้กล้าเสีย', 'P67'),
(291, NULL, NULL, '90', 'มีความคิดที่หลุดโลก มุมมองความคิดแปลกและกล้าที่จะแตกต่าง ไม่เหมือนคนอื่นเขา แต่ติดมนเรื่องของความงมงาย หากได้คิดแบบใดแล้วก็จะไม่เปลี่ยนแปลง จนกว่าจะได้ไปเจอสิ่งอื่นที่ถูกใจ จึงจะไปงมงายสิ่งอื่นเรื่อยๆ', 'P67'),
(292, NULL, NULL, '91', 'หัวคิดสมัยใหม่ วิสัยทัศน์ไกล รักการพัฒนาชอบการเปลี่ยนแปลง ไปในทางที่ดีขึ้น', 'P67'),
(293, NULL, NULL, '92', 'จินตนาการดี หัวคิดสร้างสรรค์ แปลกแหวกแนวดี มีความเข้าใจในอารมณ์และสื่อสารออกมาได้ออกดีหากฝึกฝนจินตนาการให้ถูกทาง มีโอกาสรุ่งเรือง', 'P67'),
(294, NULL, NULL, '93', 'เป็นคนที่มีเป้าหมายชัดเจน คิดอะไรทีละหลายอย่าง มุ่งมั่น และตั้งใจในสิ่งที่คิดไว้ เมื่อได้ข้อสรุปแล้ว จะตัดสินใจ อย่างเด็ดขาด และพร้อมที่จะทำใรสิ่งที่คิดให้ดีที่สุด', 'P67'),
(295, NULL, NULL, '94', 'มีความคิดหัวพัฒนาความคิดแปลกแหวกแนวไม่เหมือนใครว่าคิดนักประดิษฐ์', 'P67'),
(296, NULL, NULL, '95', 'สามารถทำความเข้าใจความรู้ต่างๆได้อย่างลึกซึ้งจนถึงแก่นแท้เรียบเรียงและอธิบายความรู้ที่มีได้อย่างเป็นขั้นเป็นตอนดูมีที่มาที่ไปพร้อมทั้งยังสามารถนำความรู้ที่มีไปประยุกต์ใช้ดัดแปลงต่อยอดได้อีกมากมาย', 'P67'),
(297, NULL, NULL, '96', 'เป็นคนที่มีไอเดียที่ดีมีความคิดสร้างสรรค์รอบด้านคิดเล่นเล่นสนุกสนุกแต่อาจจะกลายเป็นการสร้างสรรค์หรือช่องทางหาเงินได้โดยไม่รู้ตัวมีหัวทางด้านศิลปะอารมณ์ศิลปิน', 'P67'),
(298, NULL, NULL, '97', 'คิดวิเคราะห์ได้ถึงรักถึงแก่นเพราะมีความสามารถในการเจาะรายละเอียดข้อมูลพร้อมทั้งสามารถวิเคราะห์ได้เป็นอย่างดีจึงเป็นนักวางแผนที่ละเอียดถี่ถ้วนและนำไปใช้งานได้จริงเน้นการวางแผนระยะยาวเป็นความคิดที่ไม่ตกยุค', 'P67'),
(299, NULL, NULL, '98', 'มุมมองในเรื่องการปกครองที่ดีมีความเด็ดขาดความคิดมีรูปธรรมคิดการใหญ่วางแผนเพื่ออนาคตกล้าได้กล้าเสีย', 'P67'),
(300, NULL, NULL, '99', 'คิดอะไรไม่เหมือนใครคิดแปลกไม่เหมือนใครไอเดียดีสามารถนำความคิดไปใช้ได้จริงและอยากทดลองทำอะไรใหม่ใหม่อยู่เสมอขี้เบื่อดื้อ', 'P67'),
(301, NULL, NULL, '0', 'ไม่ชอบเข้าสังคม ไม่ชอบให้ใครมาบังคับ รักอิสระอยากทำอะไรก็ทำ', 'P89'),
(302, NULL, NULL, '1', 'ทิฐิสูง ไม่ง้อใคร อารมณ์แปรปรวน คาดเดายาก อยากทำอะไรก็ทำ พร้อมที่จะเหวี่ยวใส่ทุกคนที่ขวานหน้า ขี้หงุดหงิด ขี้รำคาญ ขาดความพอดในตัวเอง', 'P89'),
(303, NULL, NULL, '2', 'จิตใจดี มีความเมตตาสูง จนอาจจะเดือดร้อนตัวเอง เป็นคนโลกสวย อารมณ์แปรปรวน ขี้น้อยใจ ชอบคิดไปเอง ให้อภัยคนง่าย ไม่มีเป้าหมายที่ชัดเจน', 'P89'),
(304, NULL, NULL, '3', 'เป็นคนใจร้อน คิดว่าตัวเองเก่งเป็นที่หนึ่ง เป็นคนบ้างาน ขี้รำคาญ เกลียดความจุกจิกวุ่นวาย และอะไรที่ยืดเยื้อเกิน', 'P89'),
(305, NULL, NULL, '4', 'ชอบจับผิดคนอื่น เป็นคนหูตาไว คิดเร็วทำเร็ว ชอบเสพข่าวสารรอบตัว รักอิสระ มักไม่ค่อยมีเป้าหมาย หรือวางแผนชีวิตในระยะยาว', 'P89'),
(306, NULL, NULL, '5', 'ปิดกั้นตัวเองมีความเป็นตัวเองสูง มีแนวคิดที่ขวางโลก โดยใช้หลักการแปลกๆ มักชอบอยู่เงียบๆคนเดียว ไม่ชอบเข้าสังคม', 'P89'),
(307, NULL, NULL, '6', 'ชอบที่จะเป็นจุดเด่นในสังคม และต้องได้รับการยอมรับในวงกว้าง อยากเป็นที่รักของทุกๆคน ไม่ค่อยพึงพอใจในส่วนที่ตัวเองมี ชอบเปรียบเทียบกับคนอื่นที่ดีกว่า ขี้อิจฉา', 'P89'),
(308, NULL, NULL, '7', 'มั่นใจว่าตัวเองถูกที่สุด และคิดว่าโลกนี้มีแต่เขาผู้เดียว ทำอะไรไม่นึกถึงความรู้สึกคนอื่น เห็นแกตัว มีเกณฑ์เป็นคนมองโลกในแง่ร้าย โรคเครียด และ ซึมเสร้าสูง', 'P89'),
(309, NULL, NULL, '8', 'ไม่แคร์ใคร โลกหมุนรอบตัวเขาเอง มีความอยากโม้อยากอวด และลึกๆมีความชอบเปรียบเทียบตนเองกันคนอื่น คิดว่าทุกอย่างอยู่ในกำมือของตัวเอง จะทำอะไรก็ได้ กดดันตัวเองว่าตัวเองจะต้องมี ต้องเด่น กว่าคนอื่น ทั้งฐานะและ บรรดาศักดิ์', 'P89'),
(310, NULL, NULL, '9', 'ละเมอเพ้อฝัน อยากได้ในบางสิ่งบางอย่าง ที่ไม่มีอยู่จริงบนโลก เป็นคนมีโลกส่วนตัวสูง ผู้คนรอบตัวจะไม่สามารถเข้าใจได้และไม่คิดจะเข้าใจผู้อื่นด้วย', 'P89'),
(311, NULL, NULL, '10', 'ทิฐิสูง ไม่ง้อใคร อารมณ์แปรปรวน คาดเดายาก อยากทำอะไรก็ทำ พร้อมที่จะเหวี่ยวใส่ทุกคนที่ขวานหน้า ขี้หงุดหงิด ขี้รำคาญ ขาดความพอดในตัวเอง', 'P89'),
(312, NULL, NULL, '11', 'มีความคิดว่าทุกอย่างคือภาระของตนเอง ต้องต่อสู้ดิ้นรน ทำในสิ่งที่คนอื่นไม่ได้ร้องขอให้ช่วย แต่กลับอยากได้คำเยินยอ และคิดเป็นบุญคุณที่ได้ทำให้ และต้องการ การยอมรับ', 'P89'),
(313, NULL, NULL, '12', 'เป็นคนขี้น้อยใจแบบสุดๆ แต่ก็ยังต้องการเป็นที่นับหน้าถือตา ที่ยอมรับในสังคมการทำงานของตัวเองมักทะเลาะกับความคิดของตัวเอง', 'P89'),
(314, NULL, NULL, '13', 'เอาแต่ใจตนเอง ชอบคิดและทำอะไรแบบง่ายๆ ไม่อยู่นิ่ง คิดว่าโลกหมุนรอบตัวเอง ทำอะไรไม่เกรงใจใคร ไม่เคยเอาใจเขามาใส่ใจเรา มีความอิสระ อยากทำอะไรก็ทำ มักมีปัญหาเรื่องครอบครัว และคนรัก', 'P89'),
(315, NULL, NULL, '14', 'เป็คนขี้เบื่อ และเกลียดความจำเจ หัวโบราณหรือไร้เหตุผลมากๆ ชอบมองหาสิ่งใหม่ๆ เติมเต็มสิ่งที่เป็นประโยชน์ให้กับชีวิตตัวเองและครอบครัว ชีวิตมีสีสัน ชอบอิสระ ชอบเที่ยว ความตื่นเต้นท้าทาย หากมีแฟน นิสัยเหมือนเพื่อน จะทำให้ความรักราบบรื่นมากขึ้น', 'P89'),
(316, NULL, NULL, '15', 'มีความรับผิดชอบดีมากๆ ไม่ชอบการเปลี่ยนแปลงที่ไม่มั่นคง ซื่อสัตย์ต่อตัวเองบริวารรอบข้าง มั่นใจในตัวเองขยัน พร้อมผลักดันชีวิตตัวเองให้ก้าวหน้าอย่างมั่นคง มีเป้าหมาย', 'P89'),
(317, NULL, NULL, '16', 'ต้องการชีวิตที่สมบูรณ์ เพียบพร้อม บางครั้งจึงมักจะเป็นคนโลเล ตัดสินใจอะไรไม่ค่อยเด็ดขาด และทุกอย่างที่จะทำต้องมีแผนสำรองอยู่เสมอ', 'P89'),
(318, NULL, NULL, '17', 'เป็นคนหนักเอาเบาสู้ ทำงานสุดชีวิต เพื่อสิ่งที่มุ่งหวังและจริงจังกับชีวิตมากๆ', 'P89'),
(319, NULL, NULL, '18', 'ใครดีใครได้ เวลาตัวเองได้ไม่คิดมาก โกงคนอื่นได้หากจำเป็น แต่ห้ามคนอื่นโกง หากคนอื่นโกงจะตามเอาคืนให้ถึงที่สุด ดุ เจ้าเล่ห์ คิดแต่ได้ฝ่ายเดียว เห็นแก่ตัวที่สุด ต้องการ การยอมรับ และความเคารพยำเกรง พร้อมทั้งเกรียดการดูถูก และเสียหน้าที่่สุด', 'P89'),
(320, NULL, NULL, '19', 'รักศักดิ์ศรีของตนเองห้ามใครเหยียบย่ำทำลาย หรือหากเก่งกว่าจริงก็ยอมรับได้ เป็นคนที่มีมุมมองกว้างไกล รักการค้นคว้าสิ่งใหม่ๆ ชอบการพัฒนา เป็นคนขี้เบื่อ', 'P89'),
(321, NULL, NULL, '20', 'จิตใจดี มีความเมตตาสูง จนอาจจะเดือดร้อนตัวเอง เป็นคนโลกสวย อารมณ์แปรปรวน ขี้น้อยใจ ชอบคิดไปเอง ให้อภัยคนง่าย ไม่มีเป้าหมายที่ชัดเจน', 'P89'),
(322, NULL, NULL, '21', 'เป็นคนขี้น้อยใจแบบสุดๆ แต่ก็ยังต้องการเป็นที่นับหน้าถือตา ที่ยอมรับในสังคมการทำงานของตัวเองมักทะเลาะกับความคิดของตัวเอง', 'P89'),
(323, NULL, NULL, '22', 'เข้าอกเข้าใจผู้อื่น รักในงานบริการ ดูแลคนที่ตนเองรักดี แต่ขี้งอแง ขี้น้อยใจ อ่อนไหวง่าย อยากได้รับการดูแลในบางครั้ง ใจอ่อน ขาดความมั่นใจในตัวเอง รักครอบครัว', 'P89'),
(324, NULL, NULL, '23', 'รักความสวยงาม ชอบด้านแฟชั่น ต้องการเป็นที่ยอมรับของสังคม ทะเยอทะยาน ขี้น้อยใจในบางเวลา กล้าคิดกล้าทำ ไม่กลัวใคร เจ้าชู้ แต่ก็ขี้หึง ชอบเรียกร้องความสนใจ มีความขี้เหงา และติดเพื่อนสุดๆ ขี้เบื่อในสิ่งโบราณ ซ้ำซาก', 'P89'),
(325, NULL, NULL, '24', 'ชอบบรรยากาศแบบสบายๆ ยิ้มแย้มแจ่มใส ไม่มีปัญหากับใคร ยอมได้คือยอม ดูแลเทคแคร์คนรักเป็นอย่างดี เก่งด้านความสัมพันธ์ เป็นคนขี้เกรงใจ มักคิดถึงคนอื่นก่อนคิดถึงผลประโยชน์ส่วนตน', 'P89'),
(326, NULL, NULL, '25', 'เป็นคนขี้สงสาร ขี้เกรงใจคนอื่นเข้าสังคมได้แต่ก็ไม่ชอบเท่าไหร่ ไม่ใช่คนพูดเยอะ มักเป็นผู้ตามมากกว่าเป็นผู้นำ เป็นคนวางตัวง่ายๆ ไม่ต้องมีพิธีรีตอง เป็นที่นักของคนในครอบครัว', 'P89'),
(327, NULL, NULL, '26', 'รักครอบครัว มีความเป็นห่วงคนใกล้ตัวทุกๆคน ขี้สงสาร เป็นที่ปรึกษาในเรื่องต่างๆได้เป็นอย่างดี แต่พอมีแฟนแล้ว อาจจะชอบเรียกร้องความสนใจ ขี้งอน และขี้เหงาเป็นพิเศษ ชอบให้มีคนสนอกสนใจ', 'P89'),
(328, NULL, NULL, '27', 'เป็นคนที่ซื่อๆใสๆ ใจดีแบบไม่มีวันเปลี่ยนแปลง ยอมถูกหลอก แบบเต็มใจให้หลอกและยังคงเชื่อว่าเขาคือคนดีอยู่เสมอ เก็บความรู้สึกเก่ง ไม่ใช่ไม่เครียดไม่เศร้า แต่ไม่อยากแสดงออกมาให้คนอื่นต้องเป็นทุกข์ไปกับตัวเอง มีความเก็บกดสูง ขี้สงสาร', 'P89'),
(329, NULL, NULL, '28', 'เกลียดการดูถูกเอามากๆวางตัวเองเป็นชนชั้นสูง กว่าสภาพแวดล้อมที่อาศัยิ ใมิตรเทียมมากกว่ามิตรแท้ เป็นคนตรงๆ งานคืองาน เล่นคือเล่น ธุรกิจคือเงิน เพื่อนคือคอนเนคชั่นธุรกิจ แต่สำหรับความรัก แล้วคือการเอาชนะ มีความเอาแต่ใจมาก ถึงมากที่สุด', 'P89'),
(330, NULL, NULL, '29', 'เป็นคนที่มีความคิด ความเชื่ออะไรแปลกๆ อยู่ตลอดเวลา มองอะไรไม่เหมือนคนอื่น แต่ก็ไม่ได้ทำอะไรให้ใครเดือดร้อน อาจจะมีอารมณ์ ที่แปรปรวนและเอาแต่ใจไปบ้างเท่านั้น', 'P89'),
(331, NULL, NULL, '30', 'เป็นคนใจร้อน คิดว่าตัวเองเก่งเป็นที่หนึ่ง เป็นคนบ้างาน ขี้รำคาญ เกลียดความจุกจิกวุ่นวาย และอะไรที่ยืดเยื้อเกิน', 'P89'),
(332, NULL, NULL, '31', 'เอาแต่ใจตนเอง ชอบคิดและทำอะไรแบบง่ายๆ ไม่อยู่นิ่ง คิดว่าโลกหมุนรอบตัวเอง ทำอะไรไม่เกรงใจใคร ไม่เคยเอาใจเขามาใส่ใจเรา มีความอิสระ อยากทำอะไรก็ทำ มักมีปัญหาเรื่องครอบครัว และคนรัก', 'P89'),
(333, NULL, NULL, '32', 'รักความสวยงาม ชอบด้านแฟชั่น ต้องการเป็นที่ยอมรับของสังคม ทะเยอทะยาน ขี้น้อยใจในบางเวลา กล้าคิดกล้าทำ ไม่กลัวใคร เจ้าชู้ แต่ก็ขี้หึง ชอบเรียกร้องความสนใจ มีความขี้เหงา และติดเพื่อนสุดๆ ขี้เบื่อในสิ่งโบราณ ซ้ำซาก', 'P89'),
(334, NULL, NULL, '33', 'ขี้หงุดหงิด โมโหง่าย โกรธอะไรใครไม่มีสติยั้งคิด หากคิดว่าตนเองถูกจะลุยเต็มที่ ใครก็แย้งไม่ได้ ตรงไปตรงมา กล้าลุย ไม่กลัวใคร ขี้เบื่อ ชื่นชอบความตื่นเต้น', 'P89'),
(335, NULL, NULL, '34', 'เป็นคนใจร้อนหงุดหงิดง่ายขี้เบื่อ รักอิสระ ไม่ชอบให้ใครมาบังคับ หรือออกคำสั่ง มีความเป็นตัวเองสูง มักมีปัญหากับคนในครอบครัว หรือคนรักอยู่บ่อยๆ', 'P89'),
(336, NULL, NULL, '35', 'เป็นคนตรงไปตรงมา มีความเป็นผู้ใหญ่สูง มีความรับผิดชอบ มั่นคงในการตัดสินใจ รักการพัฒนาคุณภาพ ของชีวิต ตนเอง และคนรอบข้างพยายามทำทุกอย่างที่สามารถทำได้ให้ดีที่สุด ซึ่งอาจจะทำให้รู้สึกกดดันตัวเอง และเครียดได้', 'P89'),
(337, NULL, NULL, '36', 'เป็นคนขี้เบื่อ ชอบความโดดเด่น ไม่ซ้ำใคร ชอบทำสิ่งใหม่ๆ ชอบความท้าทาย ชอความสนุก และสนุกได้กับทุกๆเรื่องที่ได้ลงมือทำ', 'P89'),
(338, NULL, NULL, '37', 'เป็นคนมึวามอดทนสูงอาจเรียกได้ว่ากดดันตัวเองไม่เคยคิดว่าตนเองทำอะไรดี ชอบดูถูกตัวเอง มองผู้อื่นอยู่สูงกว่าตนเอง มองโลกด้านมืด เป็นคนเก็บกด มีเกณฑ์สูงที่จะเป็นโรคเครียด มีชีวิตยุ่งยากและไม่มีความสุข', 'P89'),
(339, NULL, NULL, '38', 'เป็นคนตรงๆ เต็มที่กับทุกสิ่ง เต็มที่กับทุกคนและทุกคนก็ต้องเต็มที่กับเขาด้วย สามารถอยู่คนเดียวได้ รักอิสระ เป็นคนขี้หงุดหงิด และโมโหง่าย หากเชื่อใจใครก็จะไว้ใจอยู่อย่างนั้น เป็นคนที่หากร้ายจะน่ากลัวมากๆ มีใจอาฆาตแค้นแรงและต้องเอาคืนให้ได้', 'P89'),
(340, NULL, NULL, '39', 'เป็นนักสู้คนหนึ่งไม่ชอบการอยู่กับที่ รักการเปลี่ยนแปลง การต่อสู้และการเอาชนะ เป็นคนขี้เบื่อ ใจร้อนในบางครั้ง โกรธวง่ายหายเร็ว ไม่ชอบความพ่ายแพ้ ชอบการเปลี่ยแปลงและพัฒนาที่ดีขึ้น', 'P89'),
(341, NULL, NULL, '40', 'เอาแต่ใจตนเอง ชอบคิดและทำอะไรแบบง่ายๆ ไม่อยู่นิ่ง คิดว่าโลกหมุนรอบตัวเอง ทำอะไรไม่เกรงใจใคร ไม่เคยเอาใจเขามาใส่ใจเรา มีความอิสระ อยากทำอะไรก็ทำ มักมีปัญหาเรื่องครอบครัว และคนรัก', 'P89'),
(342, NULL, NULL, '41', 'รักความสวยงาม ชอบด้านแฟชั่น ต้องการเป็นที่ยอมรับของสังคม ทะเยอทะยาน ขี้น้อยใจในบางเวลา กล้าคิดกล้าทำ ไม่กลัวใคร เจ้าชู้ แต่ก็ขี้หึง ชอบเรียกร้องความสนใจ มีความขี้เหงา และติดเพื่อนสุดๆ ขี้เบื่อในสิ่งโบราณ ซ้ำซาก', 'P89'),
(343, NULL, NULL, '42', 'ขี้หงุดหงิด โมโหง่าย โกรธอะไรใครไม่มีสติยั้งคิด หากคิดว่าตนเองถูกจะลุยเต็มที่ ใครก็แย้งไม่ได้ ตรงไปตรงมา กล้าลุย ไม่กลัวใคร ขี้เบื่อ ชื่นชอบความตื่นเต้น', 'P89'),
(344, NULL, NULL, '43', 'เป็นคนใจร้อนหงุดหงิดง่ายขี้เบื่อ รักอิสระ ไม่ชอบให้ใครมาบังคับ หรือออกคำสั่ง มีความเป็นตัวเองสูง มักมีปัญหากับคนในครอบครัว หรือคนรักอยู่บ่อยๆ', 'P89'),
(345, NULL, NULL, '44', 'เป็นคนไม่อยู่กับที่ไปโน้นทีไปนี่ทีอยู่ไม่นานเป็นคนชอบพบปะสังสรรค์แลกเปลี่ยนความคิดและลึกลึกแล้วเป็นคนขี้เหงานะ', 'P89'),
(346, NULL, NULL, '45', 'รักการเรียนรู้ชอบการพัฒนาเป็นนักสังเกตุช่างจดจำ', 'P89');
INSERT INTO `forecast_meanings` (`id`, `created_at`, `updated_at`, `number`, `content`, `position`) VALUES
(347, NULL, NULL, '46', 'รักสบายชอบเที่ยวรักสนุกมีความสุขเมื่อได้ใช้จ่ายขอให้ทำอะไรก็ได้ที่ไม่เครียดและมีความสุข', 'P89'),
(348, NULL, NULL, '47', 'เป็นคนจริงจังกับการทำงานอาจเรียกได้ว่าเคร่งเครียดเลยก็ว่าได้ระวังเรื่องสุขภาพเพราะจะทำให้พักผ่อนให้เพียงพอเป็นคนที่ซื่อตรงต่อความรู้สึกตัวเองและมั่นใจในเหตุผลของตัวเองมากเกินไป', 'P89'),
(349, NULL, NULL, '48', 'เป็นคนใช้ชีวิตแบบเรื่อยเรื่อยแต่ถ้ามีผลประโยชน์เข้ามาเมื่อไหร่ก็สามารถฉกฉวยได้ทุกครั้งโดยนึกเอาผลประโยชน์ของตนเองเป็นที่ตั้งสูงสุดในชีวิตเป็นคนขี้ระแวงแต่ก็เอาตัวรอดทุกสถานการณ์', 'P89'),
(350, NULL, NULL, '49', 'เป็นคนที่อยู่ไม่สุขคิดเร็วทำเร็วขี้เบื่อขี้หงุดหงิดอยากปรับเปลี่ยนไม่ชอบความจำเจอยากเที่ยวไปด้วยทำงานไปด้วยให้ระวังเรื่องความสะเพร่าไม่รอบคอบก็เป็นคนชอบยุ่งเรื่องชาวบ้านมีความอยากรู้อยากเห็นสูง', 'P89'),
(351, NULL, NULL, '50', 'เป็คนขี้เบื่อ และเกลียดความจำเจ หัวโบราณหรือไร้เหตุผลมากๆ ชอบมองหาสิ่งใหม่ๆ เติมเต็มสิ่งที่เป็นประโยชน์ให้กับชีวิตตัวเองและครอบครัว ชีวิตมีสีสัน ชอบอิสระ ชอบเที่ยว ความตื่นเต้นท้าทาย หากมีแฟน นิสัยเหมือนเพื่อน จะทำให้ความรักราบบรื่นมากขึ้น', 'P89'),
(352, NULL, NULL, '51', 'ชอบบรรยากาศแบบสบายๆ ยิ้มแย้มแจ่มใส ไม่มีปัญหากับใคร ยอมได้คือยอม ดูแลเทคแคร์คนรักเป็นอย่างดี เก่งด้านความสัมพันธ์ เป็นคนขี้เกรงใจ มักคิดถึงคนอื่นก่อนคิดถึงผลประโยชน์ส่วนตน', 'P89'),
(353, NULL, NULL, '52', 'เป็นคนขี้สงสาร ขี้เกรงใจคนอื่นเข้าสังคมได้แต่ก็ไม่ชอบเท่าไหร่ ไม่ใช่คนพูดเยอะ มักเป็นผู้ตามมากกว่าเป็นผู้นำ เป็นคนวางตัวง่ายๆ ไม่ต้องมีพิธีรีตอง เป็นที่นักของคนในครอบครัว', 'P89'),
(354, NULL, NULL, '53', 'เป็นคนตรงไปตรงมา มีความเป็นผู้ใหญ่สูง มีความรับผิดชอบ มั่นคงในการตัดสินใจ รักการพัฒนาคุณภาพ ของชีวิต ตนเอง และคนรอบข้างพยายามทำทุกอย่างที่สามารถทำได้ให้ดีที่สุด ซึ่งอาจจะทำให้รู้สึกกดดันตัวเอง และเครียดได้', 'P89'),
(355, NULL, NULL, '54', 'รักการเรียนรู้ชอบการพัฒนาเป็นนักสังเกตุช่างจดจำ', 'P89'),
(356, NULL, NULL, '55', 'ไม่ปรับเปลี่ยนอะไรสิ่งใดเรื่อยเรื่อยแต่มันคงจะไม่ปล่อยให้ชีวิตต้นล้มลงไปแต่ก็ไม่ได้ไขว่คว้าอะไรที่สูงเกินไปเหมือนกันเกลียดความวุ่นวายและการต่อสู้ทำงานตามที่ได้รับมอบหมายยึดถือเอากฎระเบียบเป็นที่ตั้ง', 'P89'),
(357, NULL, NULL, '56', 'เป็นคนมีพื้นฐานจิตใจดีไม่เบียดเบียนใครไม่ชอบการต่อสู้แย่งชิงหรือการปรับเปลี่ยนใดใดทั้งสิ้นเกลียดความวุ่นวายหายโกรธไวไม่ใช่คนเจ้าคิดเจ้าแค้นและที่สำคัญคือใจเย็นสุดสุด', 'P89'),
(358, NULL, NULL, '57', 'ไม่ยุ่งไม่สงสิงห์อะไรกับบุคคลภายนอกชอบอยู่เงียบเงียบคิดอะไรไปเรื่อยเรื่อยคนเดียวมีโลกส่วนตัวสูง', 'P89'),
(359, NULL, NULL, '58', 'มาคิดเอาเรื่องของผลประโยชน์ส่วนตัวเป็นหลักเห็นแก่ตัวมีความระมัดระวังตัวสูงและไม่เชื่อใจใครง่ายง่าย', 'P89'),
(360, NULL, NULL, '59', 'เป็นคนนิ่งนิ่งแต่หากได้จริงจังกับอะไรบางอย่างก็จะจริงจังมากถึงขั้นหมกมุ่นรักการเรียนรู้และชอบคลิปประยุกต์อะไรเล่นเล่นอยู่คนเดียวรักการพัฒนาศักยภาพของตัวเองเป็นคนมองโลกตามหลักการและเหตุผลออกแนวสันโดษไม่ชอบยุ่งกับใครโลกส่วนตัวสูง', 'P89'),
(361, NULL, NULL, '60', 'ชอบที่จะเป็นจุดเด่นในสังคม และต้องได้รับการยอมรับในวงกว้าง อยากเป็นที่รักของทุกๆคน ไม่ค่อยพึงพอใจในส่วนที่ตัวเองมี ชอบเปรียบเทียบกับคนอื่นที่ดีกว่า ขี้อิจฉา', 'P89'),
(362, NULL, NULL, '61', 'ต้องการชีวิตที่สมบูรณ์ เพียบพร้อม บางครั้งจึงมักจะเป็นคนโลเล ตัดสินใจอะไรไม่ค่อยเด็ดขาด และทุกอย่างที่จะทำต้องมีแผนสำรองอยู่เสมอ', 'P89'),
(363, NULL, NULL, '62', 'รักครอบครัว มีความเป็นห่วงคนใกล้ตัวทุกๆคน ขี้สงสาร เป็นที่ปรึกษาในเรื่องต่างๆได้เป็นอย่างดี แต่พอมีแฟนแล้ว อาจจะชอบเรียกร้องความสนใจ ขี้งอน และขี้เหงาเป็นพิเศษ ชอบให้มีคนสนอกสนใจ', 'P89'),
(364, NULL, NULL, '63', 'เป็นคนขี้เบื่อ ชอบความโดดเด่น ไม่ซ้ำใคร ชอบทำสิ่งใหม่ๆ ชอบความท้าทาย ชอความสนุก และสนุกได้กับทุกๆเรื่องที่ได้ลงมือทำ', 'P89'),
(365, NULL, NULL, '64', 'รักสบายชอบเที่ยวรักสนุกมีความสุขเมื่อได้ใช้จ่ายขอให้ทำอะไรก็ได้ที่ไม่เครียดและมีความสุข', 'P89'),
(366, NULL, NULL, '65', 'เป็นคนมีพื้นฐานจิตใจดีไม่เบียดเบียนใครไม่ชอบการต่อสู้แย่งชิงหรือการปรับเปลี่ยนใดใดทั้งสิ้นเกลียดความวุ่นวายหายโกรธไวไม่ใช่คนเจ้าคิดเจ้าแค้นและที่สำคัญคือใจเย็นสุดสุด', 'P89'),
(367, NULL, NULL, '66', 'รักความสบายเจ้าสำอางรักสวยรักงามชอบเข้าสังคมชอบเป็นจุดสนใจมีออราความเป็นซุปเปอร์สตาร์อยู่ในตัวและสิ่งที่ว่ามาอาจจะทำให้เป็นคนใช้เงินค่อนข้างเก่ง', 'P89'),
(368, NULL, NULL, '67', 'ใช้เงินเก่งซื้อทุกอย่างที่จะทำให้มีหน้ามีตาในสังคมเพื่อเติมเต็มชีวิตหรือปกปิดปมในชีวิตต้องการหาบางสิ่งบางอย่างมาเติมเต็มให้ชีวิตสมบูรณ์แบบไม่ว่าจะเรื่องรักหรือเงินทองแต่โอกาสสมหวังก็ค่อนข้างน้อยมองโลกในด้านลบอยู่บ่อยครั้งชอบตัดพ้อเรื่องโชคชะตาชีวิตที่เกิดมาไม่เท่าเทียมคนอื่นชอบเปรียบเทียบตัวเองกับคนที่ดีกว่า', 'P89'),
(369, NULL, NULL, '68', 'ลงนอ่ะหลงตัวเองลงอำนาจบารมีหลวงเงินตราติดอยู่ในกิเลสมากๆในกามารมณ์ขาดความรู้สึกผิดชอบชั่วดีวันเวียนอยู่ในสังคมของธุรกิจสีเทามากเอารัดเอาเปรียบคนอื่นเสมอ', 'P89'),
(370, NULL, NULL, '69', 'เจ้าสำราญรักสนุกมีโชคแบบฟลุ๊คฟลุ๊คทั้งในเรื่องงานและเรื่องเงินอารมณ์แปรปรวนในบางเวลา', 'P89'),
(371, NULL, NULL, '70', 'มั่นใจว่าตัวเองถูกที่สุด และคิดว่าโลกนี้มีแต่เขาผู้เดียว ทำอะไรไม่นึกถึงความรู้สึกคนอื่น เห็นแกตัว มีเกณฑ์เป็นคนมองโลกในแง่ร้าย โรคเครียด และ ซึมเสร้าสูง', 'P89'),
(372, NULL, NULL, '71', 'เป็นคนหนักเอาเบาสู้ ทำงานสุดชีวิต เพื่อสิ่งที่มุ่งหวังและจริงจังกับชีวิตมากๆ', 'P89'),
(373, NULL, NULL, '72', 'เป็นคนที่ซื่อๆใสๆ ใจดีแบบไม่มีวันเปลี่ยนแปลง ยอมถูกหลอก แบบเต็มใจให้หลอกและยังคงเชื่อว่าเขาคือคนดีอยู่เสมอ เก็บความรู้สึกเก่ง ไม่ใช่ไม่เครียดไม่เศร้า แต่ไม่อยากแสดงออกมาให้คนอื่นต้องเป็นทุกข์ไปกับตัวเอง มีความเก็บกดสูง ขี้สงสาร', 'P89'),
(374, NULL, NULL, '73', 'เป็นคนมึวามอดทนสูงอาจเรียกได้ว่ากดดันตัวเองไม่เคยคิดว่าตนเองทำอะไรดี ชอบดูถูกตัวเอง มองผู้อื่นอยู่สูงกว่าตนเอง มองโลกด้านมืด เป็นคนเก็บกด มีเกณฑ์สูงที่จะเป็นโรคเครียด มีชีวิตยุ่งยากและไม่มีความสุข', 'P89'),
(375, NULL, NULL, '74', 'เป็นคนจริงจังกับการทำงานอาจเรียกได้ว่าเคร่งเครียดเลยก็ว่าได้ระวังเรื่องสุขภาพเพราะจะทำให้พักผ่อนให้เพียงพอเป็นคนที่ซื่อตรงต่อความรู้สึกตัวเองและมั่นใจในเหตุผลของตัวเองมากเกินไป', 'P89'),
(376, NULL, NULL, '75', 'ไม่ยุ่งไม่สงสิงห์อะไรกับบุคคลภายนอกชอบอยู่เงียบเงียบคิดอะไรไปเรื่อยเรื่อยคนเดียวมีโลกส่วนตัวสูง', 'P89'),
(377, NULL, NULL, '76', 'ใช้เงินเก่งซื้อทุกอย่างที่จะทำให้มีหน้ามีตาในสังคมเพื่อเติมเต็มชีวิตหรือปกปิดปมในชีวิตต้องการหาบางสิ่งบางอย่างมาเติมเต็มให้ชีวิตสมบูรณ์แบบไม่ว่าจะเรื่องรักหรือเงินทองแต่โอกาสสมหวังก็ค่อนข้างน้อยมองโลกในด้านลบอยู่บ่อยครั้งชอบตัดพ้อเรื่องโชคชะตาชีวิตที่เกิดมาไม่เท่าเทียมคนอื่นชอบเปรียบเทียบตัวเองกับคนที่ดีกว่า', 'P89'),
(378, NULL, NULL, '77', 'เป็นคนโลกส่วนตัวสูงไม่แคร์ใครสามารถอยู่คนเดียวทำงานคนเดียวบนโลกใบนี้ได้ปากไม่ตรงกับใจส่วนใหญ่จะครองตัวเป็นโสดไม่ก็หากมีคนรักก็จะมั้งเมินกันไม่ทำการบ้านมีความเครียดสูงและสามารถเทียบได้กับทุกเรื่องแม้จะเป็นเรื่องเล็กๆน้อยๆก็ตาม', 'P89'),
(379, NULL, NULL, '78', 'รักพวกพ้องบริวารทั้งหลายเหมือนเป็นครอบครัวให้ใจเต็มที่รักแรงเกลียดแรง', 'P89'),
(380, NULL, NULL, '79', 'มีโลกส่วนตัวสูงเข้าถึงยากถ้าไม่สนิทใจจะไม่พูดคุยด้วยยึดมั่นในความคิดตัวเองขาดความลึกซึ้งในเรื่องอารมณ์รัก', 'P89'),
(381, NULL, NULL, '80', 'ไม่แคร์ใคร โลกหมุนรอบตัวเขาเอง มีความอยากโม้อยากอวด และลึกๆมีความชอบเปรียบเทียบตนเองกันคนอื่น คิดว่าทุกอย่างอยู่ในกำมือของตัวเอง จะทำอะไรก็ได้ กดดันตัวเองว่าตัวเองจะต้องมี ต้องเด่น กว่าคนอื่น ทั้งฐานะและ บรรดาศักดิ์', 'P89'),
(382, NULL, NULL, '81', 'ใครดีใครได้ เวลาตัวเองได้ไม่คิดมาก โกงคนอื่นได้หากจำเป็น แต่ห้ามคนอื่นโกง หากคนอื่นโกงจะตามเอาคืนให้ถึงที่สุด ดุ เจ้าเล่ห์ คิดแต่ได้ฝ่ายเดียว เห็นแก่ตัวที่สุด ต้องการ การยอมรับ และความเคารพยำเกรง พร้อมทั้งเกรียดการดูถูก และเสียหน้าที่่สุด', 'P89'),
(383, NULL, NULL, '82', 'เกลียดการดูถูกเอามากๆวางตัวเองเป็นชนชั้นสูง กว่าสภาพแวดล้อมที่อาศัยิ ใมิตรเทียมมากกว่ามิตรแท้ เป็นคนตรงๆ งานคืองาน เล่นคือเล่น ธุรกิจคือเงิน เพื่อนคือคอนเนคชั่นธุรกิจ แต่สำหรับความรัก แล้วคือการเอาชนะ มีความเอาแต่ใจมาก ถึงมากที่สุด', 'P89'),
(384, NULL, NULL, '83', 'เป็นคนตรงๆ เต็มที่กับทุกสิ่ง เต็มที่กับทุกคนและทุกคนก็ต้องเต็มที่กับเขาด้วย สามารถอยู่คนเดียวได้ รักอิสระ เป็นคนขี้หงุดหงิด และโมโหง่าย หากเชื่อใจใครก็จะไว้ใจอยู่อย่างนั้น เป็นคนที่หากร้ายจะน่ากลัวมากๆ มีใจอาฆาตแค้นแรงและต้องเอาคืนให้ได้', 'P89'),
(385, NULL, NULL, '84', 'เป็นคนใช้ชีวิตแบบเรื่อยเรื่อยแต่ถ้ามีผลประโยชน์เข้ามาเมื่อไหร่ก็สามารถฉกฉวยได้ทุกครั้งโดยนึกเอาผลประโยชน์ของตนเองเป็นที่ตั้งสูงสุดในชีวิตเป็นคนขี้ระแวงแต่ก็เอาตัวรอดทุกสถานการณ์', 'P89'),
(386, NULL, NULL, '85', 'มาคิดเอาเรื่องของผลประโยชน์ส่วนตัวเป็นหลักเห็นแก่ตัวมีความระมัดระวังตัวสูงและไม่เชื่อใจใครง่ายง่าย', 'P89'),
(387, NULL, NULL, '86', 'ลงนอ่ะหลงตัวเองลงอำนาจบารมีหลวงเงินตราติดอยู่ในกิเลสมากๆในกามารมณ์ขาดความรู้สึกผิดชอบชั่วดีวันเวียนอยู่ในสังคมของธุรกิจสีเทามากเอารัดเอาเปรียบคนอื่นเสมอ', 'P89'),
(388, NULL, NULL, '87', 'รักพวกพ้องบริวารทั้งหลายเหมือนเป็นครอบครัวให้ใจเต็มที่รักแรงเกลียดแรง', 'P89'),
(389, NULL, NULL, '88', 'เป็นคนไม่เชื่ออะไรใครง่ายง่ายแต่ถ้า เค้าเชื่อใจใครก็จะเชื่อหมดใจเรียกได้ว่าสำหรับเพื่อนเค้าให้ใจไปเลยใจถึงใจกล้าเห็นแก่พวกพ้องเพื่อนฝูงมักเชื่อเพื่อนคนภายนอกมากกว่าครอบครัว', 'P89'),
(390, NULL, NULL, '89', 'เป็นคนที่รักความยุติธรรมซื่อสัตย์ในวาจาพูดจริงทำจริงรักพวกพ้องและจะคบค้าสมาคมเฉพาะบุคคลที่อยู่ในวงสังคมเดียวกันเท่านั้นใจใหญ่ชอบความยิ่งใหญ่', 'P89'),
(391, NULL, NULL, '90', 'ละเมอเพ้อฝัน อยากได้ในบางสิ่งบางอย่าง ที่ไม่มีอยู่จริงบนโลก เป็นคนมีโลกส่วนตัวสูง ผู้คนรอบตัวจะไม่สามารถเข้าใจได้และไม่คิดจะเข้าใจผู้อื่นด้วย', 'P89'),
(392, NULL, NULL, '91', 'รักศักดิ์ศรีของตนเองห้ามใครเหยียบย่ำทำลาย หรือหากเก่งกว่าจริงก็ยอมรับได้ เป็นคนที่มีมุมมองกว้างไกล รักการค้นคว้าสิ่งใหม่ๆ ชอบการพัฒนา เป็นคนขี้เบื่อ', 'P89'),
(393, NULL, NULL, '92', 'เกลียดการดูถูกเอามากๆวางตัวเองเป็นชนชั้นสูง กว่าสภาพแวดล้อมที่อาศัยิ ใมิตรเทียมมากกว่ามิตรแท้ เป็นคนตรงๆ งานคืองาน เล่นคือเล่น ธุรกิจคือเงิน เพื่อนคือคอนเนคชั่นธุรกิจ แต่สำหรับความรัก แล้วคือการเอาชนะ มีความเอาแต่ใจมาก ถึงมากที่สุด', 'P89'),
(394, NULL, NULL, '93', 'เป็นนักสู้คนหนึ่งไม่ชอบการอยู่กับที่ รักการเปลี่ยนแปลง การต่อสู้และการเอาชนะ เป็นคนขี้เบื่อ ใจร้อนในบางครั้ง โกรธวง่ายหายเร็ว ไม่ชอบความพ่ายแพ้ ชอบการเปลี่ยแปลงและพัฒนาที่ดีขึ้น', 'P89'),
(395, NULL, NULL, '94', 'เป็นคนที่อยู่ไม่สุขคิดเร็วทำเร็วขี้เบื่อขี้หงุดหงิดอยากปรับเปลี่ยนไม่ชอบความจำเจอยากเที่ยวไปด้วยทำงานไปด้วยให้ระวังเรื่องความสะเพร่าไม่รอบคอบก็เป็นคนชอบยุ่งเรื่องชาวบ้านมีความอยากรู้อยากเห็นสูง', 'P89'),
(396, NULL, NULL, '95', 'เป็นคนนิ่งนิ่งแต่หากได้จริงจังกับอะไรบางอย่างก็จะจริงจังมากถึงขั้นหมกมุ่นรักการเรียนรู้และชอบคลิปประยุกต์อะไรเล่นเล่นอยู่คนเดียวรักการพัฒนาศักยภาพของตัวเองเป็นคนมองโลกตามหลักการและเหตุผลออกแนวสันโดษไม่ชอบยุ่งกับใครโลกส่วนตัวสูง', 'P89'),
(397, NULL, NULL, '96', 'เจ้าสำราญรักสนุกมีโชคแบบฟลุ๊คฟลุ๊คทั้งในเรื่องงานและเรื่องเงินอารมณ์แปรปรวนในบางเวลา', 'P89'),
(398, NULL, NULL, '97', 'มีโลกส่วนตัวสูงเข้าถึงยากถ้าไม่สนิทใจจะไม่พูดคุยด้วยยึดมั่นในความคิดตัวเองขาดความลึกซึ้งในเรื่องอารมณ์รัก', 'P89'),
(399, NULL, NULL, '98', 'เป็นคนที่รักความยุติธรรมซื่อสัตย์ในวาจาพูดจริงทำจริงรักพวกพ้องและจะคบค้าสมาคมเฉพาะบุคคลที่อยู่ในวงสังคมเดียวกันเท่านั้นใจใหญ่ชอบความยิ่งใหญ่', 'P89'),
(400, NULL, NULL, '99', 'ไม่ชอบอยู่นิ่งชอบศึกษาค้นคว้าและเรียนรู้ในสิ่งที่จะพัฒนาศักยภาพของตัวเองมีความทันสมัยชอบในเรื่องเทคโนโลยีชอบทำบุญเอาตัวเองเป็นจุดศูนย์กลาง', 'P89');